(2, 55, 'Minden bolygó népessége közelít a faluk és városok által biztosított lakóhely, és a rendelkezésre álló élelmiszer mennyisége közül a kisebbikhez (célszám). Ha van még szabad lakóhely és elég élelmiszer, akkor gyorsan nő a lakosság (a népesség és a célszám különbségének 0-20%-ával, a moráltól függően). Ha túl magas a népesség, akkor lassan csökken (a népesség és a célszám különbségének 5-15%-ával, a moráltól függően).', '', 'Lakóhely', '', 'Dwelling space'),
(2, 56, 'Húsből, növényből, gombából, gabonából előállított ennivaló. Mértékegysége az RDA (recommended daily allowance), ami pont egy ember szükségleteit fedezi. Megfelelő kajatermelés hiányában a teljes gazdaság könnyen összeomolhat, mivel élelem nélkül a népesség gyorsan csökken, így nem lesz elég munkás a gyárakban (köztük az élelmiszergyárakban sem, ami tovább rontja a helyzetet). Éppen ezért az energia és a lakóhely mellett ez a harmadik erőforrás, amire nagyon kell figyelni.', 'kaja', 'Élelmiszer', '', 'Food'),
(2, 57, 'Minden gyár csak akkor működik, ha van elegendő munkás. A munkaerő mindig a népesség fele, hiszen a gyerekek, idősek és a betegek nem tudnak dolgozni. A munkaerő aktuális kihasználtságát (Munkaerőhelyzet) a bolygó adatlapján lehet nyomon követni. Ha túl alacsony, akkor tele vagy fölös kapacitásokkal, vagyis érdemes újabb gyárakat beüzemelni. Ha viszont 100% fölé mész, akkor a gyáraid csak részlegesen fognak üzemelni, mert nincs elég munkás. Mivel az az élelmiszeripart és a településeket is érinti, ezért elkezdhet csökkeni a népességed, ami tovább rontja a helyzetet. Ezért ilyenkor legjobb, ha inaktiválsz néhány nem alapvető gyárat, hogy helyreálljon az egyensúly. Utána pedig bővítsd a népességet, hogy legyen elég munkásod.', '', 'Munkaerő', '', 'Manpower'),
(2, 58, 'A magasabb szintű üzemekbe kellenek képzett szakemberek, akik csak városokban laknak.', '', 'Képzett munkaerő', '', 'Qualified manpower'),
(2, 59, 'Energia nélkül megáll az élet. Kulcsfontosságú, hogy mindig legyen elegendő rendelkezésre álló energia. A legváltozatosabb energiaforrásokkal a D-osztályú bolygók büszkélkedhetnek.', 'energia', 'Energia', '', 'Energy'),
(2, 60, 'Az egyik legfontosabb építőipari alapanyag, a kő forrása. Körönként van egy minimális feltárás (100, C-osztályú bolygón 200), ennél többet kutatóintézettel lehet elérni (intézetenként 500, C-bolygón 1000).', 'nyers_ko', 'Nyers kő', '', 'Raw stone'),
(2, 61, 'Az egyik fontos feldolgozóipari alapanyag, a homok forrása. Körönként van egy minimális feltárás (100, B-osztályú bolygón 200), ennél többet kutatóintézettel lehet elérni (intézetenként 500, B-bolygón 1000).', 'nyers_homok', 'Nyers homok', '', 'Raw sand'),
(2, 62, 'A legfontosabb hadiipari alapanyag, a titán forrása. Körönként van egy minimális feltárás (100, E-osztályú bolygón 200), ennél többet kutatóintézettel lehet elérni (intézetenként 500, E-bolygón 1000).', 'titanerc', 'Titánérc', '', 'Titanium ore'),
(2, 63, 'Az atomerőművek üzemanyagául szolgáló dúsított urán forrása. Körönként van egy minimális feltárás (5, A-osztályú bolygón 10), ennél többet kutatóintézettel lehet elérni (intézetenként 25, A-bolygón 50).', 'uranerc', 'Uránérc', '', 'Uranium ore'),
(2, 64, 'A kövön kívül a legfontosabb, ökoszférából nyert építő- és feldolgozóipari alapanyag.', 'fa', 'Fa', '', 'Lumber'),
(2, 65, 'A legfontosabb építőipari alapanyag, ami az űreszközök kivételével mindenhez szükséges.', 'ko', 'Kő', '', 'Stone'),
(2, 66, 'A homokból nyerhető kvarckristályok az üveg és a félvezetők alapanyagai.', 'homok', 'Homok', '', 'Sand'),
(2, 67, 'E nélkül a fém nélkül elképzelhetetlen a fejlett technika és a hadiipar.', 'titan', 'Titán', '', 'Titanium'),
(2, 68, 'Az atomerőművek hajtóanyagát urándúsítók állítják elő.', 'uran', 'Dúsított urán', '', 'Enriched uranium'),
(2, 69, 'A fa száraz lepárlásával előállított szén az olaj alapanyaga, és a titángyártáshoz is szükséges.', 'szen', 'Szén', '', 'Coal'),
(2, 70, 'A Fischer-Tropsch-eljárás továbbfejlesztett változatával szénből olajat állítanak elő. Mivel az így nyert olaj energiaköltsége meglehetősen magas, ezért üzemanyagnak nem hatékony, inkább műanyagok gyártására használják.', 'olaj', 'Olaj', '', 'Oil'),
(2, 71, 'A műanyaggyár szintetikus olajból állít elő különféle műanyagokat (polipropilének, polietilének...), melyeket elsősorban a háztartásokban és űrhajókban hasznosítanak.', 'muanyag', 'Műanyag', '', 'Plastic'),
(2, 72, 'Az üveget tiszta kvarchomokból lehet előállítani, és főként városok, munkaerőigényes üzemek építéséhez használják.', 'uveg', 'Üveg', '', 'Glass'),
(2, 73, 'A félvezetőket űrhajókban és a hírszerzésnél használják, irányító, kommunikációs, jelfeldolgozó számítógépek formájában.', 'felvezeto', 'Félvezető', '', 'Chip'),
(2, 74, 'A bolygók felett állomásozó flották morálját a kocsmák növelik, ahol patakokban folyik az alkohol.', 'alkohol', 'Alkohol', '', 'Alcoholic beverage'),
(2, 75, '', 'matrozmoral', 'Matrózmorál', '', ''),
(2, 76, '', 'kemkedes', 'Kémkapacitás', '', ''),
(1, 1, 'Az egyik legalapvetőbb megújuló energiaforrás. Egy nagy kiterjedésű tükörrendszer az úgynevezett naptoronyra irányítja a beérkező fényt, ahol sóolvadékot hevítenek vele 300-400 fokra. Ezzel egyrészt turbinákat hajtanak meg, melyek áramot termelnek, másrészt a hőt hosszabb időre is el lehet raktározni, így az erőmű teljesítménye éjjel-nappal azonos lehet. Mivel tiszta időben működik nagy hatásfokkal, csak a napfényes B-osztályú bolygókon lehet építeni.', 'naperomu', 'Naperőmű', '', 'Solar power station'),
(1, 2, 'Egy bolygókörüli pályára állított műhold napelemekkel megpakolva. Az összegyűjtött energiát mikrohullámon sugározza le a bolygó felszínére, ahol egy hatalmas antenna fogadja azt. Mivel az SPS az űrben van, sem az éjszakák, sem a rossz időjárás nem befolyásolják a teljesítményét, így hatékonyabb a felszíni naperőműveknél.', 'sps', 'SPS', '', 'SPS'),
(1, 3, '[Ez az erőmű ki lett véve a játékból, csak easter egg-ként szerepel.] Ez a napenergia hasznosításának non plus ultrája. Nagyon sok Nap körüli pályára állított SPS-ből áll, melyek először csak egy gyűrűt alkotnak, aztán kettőt, és így tovább. A végállapot egy hatalmas gömb, ami teljesen körbeveszi a központi csillagot, így annak teljes kisugárzott energiája hasznosítható (2-es típusú civilizáció a Kardasev-skálán). Egy teljesen kész Dyson-gömb mintegy 100 trillió MW energiát termel, amiből másodpercenként nagyjából egymillió tonna anyagot lehet előállítani, vagyis ez egyben a nyersanyagproblémákat is megoldja. Viszont borzasztóan drága.', 'dysongomb', 'Dyson-gömb', '', 'Dyson sphere'),
(1, 4, 'Néhány tucat szélturbina egy területen. Teljesítménye alacsony, igaz gyorsan és olcsón megépíthető. További előnye, hogy a turbinák közti terület mezőgazdaságilag hasznosítható.', 'szelfarm', 'Szélfarm', '', 'Wind farm'),
(1, 5, 'A folyókkal jól ellátott A- és D-osztályú bolygókon építhető nagy teljesítményű erőműtípus. Működése során minimális negatív környezeti hatása van, viszont nagy területet foglal el.', 'vizeromu', 'Vízi erőmű', '', 'Hydroelectric power station'),
(1, 6, 'Tengerek és óceánok partjára épített hatalmas hullámerőmű. Kizárólag C-, D- és E-osztályú bolygókon építhető.', 'hullamfarm', 'Hullámfarm', '', 'Wave farm'),
(1, 7, 'A hullámfarmhoz hasonlóan ezt az erőművet is csak C-, D- és E-osztályú bolygókon lehet építeni. Működéséhez további feltétel, hogy a bolygó holddal rendelkezzen, hiszen ez kelti azt az árapályhatást, ami az energiát termeli.', 'arapalyeromu', 'Árapályerőmű', '', 'Tidal power station'),
(1, 8, 'Az ozmózis erőmű a folyótorkolatokban a sós és édes víz keveredéséből állít elő energiát. A beáramló sós vizet egy féligáteresztő membrán választja el az édestől, és a koncentrációkülönbség az édes vizet átnyomja a membránon. A keletkező nagy nyomású kevert vízzel turbinákat hajtanak meg, ezek termelik az áramot. Nagy hatásfokú ozmózis erőművet csak D-osztályú bolygókon lehet építeni.', 'ozmoziseromu', 'Ozmózis erőmű', '', 'Osmotic plant'),
(1, 9, 'E-osztályú bolygókon kedvelt olcsó energiaforrás. Gejzírek és vulkánok közelében építik.', 'geotermikuseromu', 'Geotermikus erőmű', '', 'Geothermal power plant'),
(1, 10, 'A geotermikus erőmű továbbfejlesztett változata. Előnye, hogy bármilyen bolygón építhető, és teljesítménye nagyobb. Hátránya a magasabb építési költség.', 'hdr', 'HDR erőmű', '', 'HDR plant'),
(1, 11, 'A bioetanol cukornádból, kukoricából, búzából, burgonyából előállított üzemanyag, mely erőműben elégetve olcsó energiaforrás. Hátránya, hogy táplálékforrást fogyaszt.', 'bioetanol', 'Bioetanol erőmű', '', 'Bioethanol power station'),
(1, 12, 'Urán meghajtású erőmű. Ebből az elemből a bolygók nagy részén (de főleg az A-osztályúakon) hatalmas készletek vannak a föld mélyén, emiatt szinte megújuló energiaforrásnak tekinthető.', 'atomeromu', 'Atomerőmű', '', 'Nuclear power plant'),
(1, 13, 'A fúziós reaktor hidrogénből állít elő héliumot és nagy mennyiségű energiát. Bár a hidrogén forrása legtöbbször víz, melyet fel kell bontani, az erőmű nettó teljesítménye így is hatalmas. Hátránya, hogy drága megépíteni.', 'fuziosreaktor', 'Fúziós reaktor', '', 'Fusion power plant'),
(1, 14, 'A húsüzem a húsfeldolgozás összes fázisát tartalmazza: vadászok járják a vidéket, hogy ehető állatokat keressenek (panda, zebra, zsiráf, bárány, marha, vaddisznó, vapiti, barna medve), a megölt állatot kivéreztetik, megnyúzzák, feldarabolják, végül a nyers húsból (főzéssel, sütéssel) fogyasztható ételt készítenek. A gyár outputja élelmiszer.', 'husuzem', 'Húsüzem', '', 'Meat factory'),
(1, 15, 'A vegagyár a húsüzemhez hasonlóan integrált gyár, csak az input gomba vagy növény (rizs, yam, banán, kukorica, füge, majomkenyérfa, szőlő, olajfa, krumpli), az output élelmiszer. Az A- és B-osztályú bolygókon a fogyasztható növények túlsúlya a jellemző, a D- és E-osztályúakon pedig az állatoké.', 'vegagyar', 'Vegagyár', '', 'Veg factory'),
(1, 16, 'A kenyérgyár egy speciális vegagyár, melynek inputja búza (C-), árpa (D-) vagy rozs (E-osztályú bolygók). Az output élelmiszer.', 'kenyergyar', 'Kenyérgyár', '', 'Bakery'),
(1, 17, 'A szeszfőzde bizonyos növényekből állít elő alkoholt: cukornádból rumot, agavéből tequilát, szőlőből bort, búzából és árpából sört, krumpliból és rozsból vodkát. Az alkohol felhasználási helye a kocsma, ami az állomásozó flották morálját növeli.', 'szeszfozde', 'Szeszfőzde', '', 'Distillery'),
(1, 18, 'A fűrészmalomban az élő fák (ébenfa, majomkenyérfa, cédrus, bükk, fenyő) kivágása és feldolgozása zajlik, melynek outputját (gerendák, lemezek, deszkák) elsősorban gyárak, házak, bútorok készítéséhez (illetve szén előállításához) használják. Elsőre furcsának tűnhet, hogy még a 35. században is fából építkeznek, de ha azt vesszük, hogy a fás növények evolúciós története majd'' négyszázmillió évre nyúlik vissza, nem csoda, hogy még mindig ez a cellulóz, hemicellulóz és lignin keverék az egyik leghatékonyabb építőanyag. Mivel szinte minden gyárhoz szükség van fára, egy erős gazdaság alapja sok fűrészmalom.', 'fureszmalom', 'Fűrészmalom', '', 'Sawmill'),
(1, 19, 'A kőbánya a fa mellett a másik alapvető házépítéshez használt nyersanyag, a kő előállításának helye. Egy komoly gazdasághoz sok kőbányára van szükség, mivel szinte minden gyár építéséhez használnak követ.', 'kobanya', 'Kőbánya', '', 'Quarry'),
(1, 20, 'A homokbánya az üveg- és félvezetőgyártáshoz elengedhetetlen szilícium forrása. A kibányászott kvarchomokot megtisztítják a mésztől, csillámföldpáttól és egyéb szennyező anyagoktól, hogy csak tiszta szilícium-dioxid maradjon.', 'homokbanya', 'Homokbánya', '', 'Sand mine'),
(1, 21, 'A titánmű egy titánbánya és egy kohó integrációja. Utóbbi funkciójához szenet is felhasznál. Az előállított titánt űrhajók gyártásához és nagyobb gyárak építéséhez használják.', 'titanmu', 'Titánmű', '', 'Titanium works'),
(1, 22, 'Az urándúsító bánya és dúsító egyben. A 22. században a MAD-doktrína visszaszorulásával a nukleáris fegyverek gyártása lényegében megszűnt, így a teljes természetes uránkészlet enyhén (3-4%-ra) dúsított uránpasztillák előállítására fordítható, melyeket atomerőművekben hasznosítanak.', 'uranuzem', 'Urándúsító', '', 'Enrichment plant'),
(1, 23, 'Az üveggyár tiszta kvarchomokból állít elő üveget. Ezt városok és magasabb szintű gyárak építéséhez használják.', 'uveggyar', 'Üveggyár', '', 'Glass factory'),
(1, 24, 'A félvezetőgyárnak, bár homokból nyeri ki a szükséges szilíciumot, legfőbb inputja a jól képzett munkaerő. Az előállított chipeket űrhajókban és a high tech iparban (kutatóintézet, hírszerzés...) használják, irányító, kommunikációs, jelfeldolgozó számítógépek formájában.', 'felvezogyar', 'Félvezetőgyár', '', 'Chip factory'),
(1, 25, 'A szénégető a terraformált (vagyis a játékban megtalálható összes) bolygók egyik specialitása. Mivel természetes szén csak geológiai időtávon alakul ki jelentős mennyiségben, a pár száz éve belakott bolygókon iparilag kell termelni. A fák száraz lepárlásával előállt faszenet további kémiai eljárásokkal kell megtisztítani a szennyező anyagoktól. A gyár outputját olaj- és titángyártáshoz használják.', 'szenegeto', 'Szénégető', '', 'Coal factory'),
(1, 26, 'Az olajgyár szintén a terraformálásból fakadó szükségszerűség. A Fischer-Tropsch-eljárás továbbfejlesztett változatával szénből kőolajat állítanak elő. Mivel az így nyert olaj energiaköltsége meglehetősen magas, ezért üzemanyagnak nem hatékony, inkább műanyagok gyártására használják.', 'olajgyar', 'Olajgyár', '', 'Oil factory'),
(1, 27, 'A műanyaggyár szintetikus olajból állít elő különféle műanyagokat (polipropilének, polietilének...), melyeket űrhajók gyártására, és városok illetve magasabb szintű gyárak építésére használnak.', 'muanyaggyar', 'Műanyaggyár', '', 'Plastic factory'),
(1, 28, 'Az űrhajógyárban természetesen űrhajókat gyártanak. A feltüntetett output HP-ban értendő, és 100 HP tesz ki egy teljes hajót. Az elérhető hajótípusok az űrhajózás és más technológiák fejlettségi szintjétől függenek.', 'urhajogyar', 'Űrhajógyár', '', 'Shipyard'),
(1, 29, 'A falu kis népsűrűségű, fejletlen infrastruktúrával rendelkező település. Előnye, hogy olcsó megépíteni, és alacsony az energiaigénye. Hátránya, hogy a technikai fejlődéshez városokra (és az onnan származó képzett munkaerőre) van szükség.', 'falu', 'Falu', '', 'Village'),
(1, 30, 'A város sűrűn lakott, utakkal, közművekkel, oktatási intézményekkel jól ellátott település. Előnye, hogy magasan képzett lakosságával lehetővé teszi a technikai fejlődést. Hátránya a magasabb építési és fenntartási költség.', 'varos', 'Város', '', 'City'),
(1, 31, 'A kutatóintézet a technikai fejlődés motorja. Enélkül sem a fejlettebb erőművek, sem a komolyabb űrhajók nem érhetők el. Ezenkívül a kifogyóban lévő természeti kincseket (nyers kő, nyers homok, titánérc, uránérc) az itt dolgozó geológusok tudják pótolni új lelőhelyek feltárásával.', 'kutatoint', 'Kutatóintézet', '', 'Research lab'),
(1, 32, 'A hírszerző központban képzik a kémeket, kémelhárítókat, szabotőröket. Ez a felderítés és a gerilla-hadviselés székhelye.', 'hirszerzokozpont', 'Hírszerző központ', '', 'Intelligence HQ'),
(1, 33, 'Az űrkikötő lényege a bolygó felett állomásozó flották moráljának növelése. Ennek alapja az alkoholárusítás és -fogyasztás, ami még évezredek múlva is a stresszoldás egy fő formája.</p>\r\n<p>Ha egy flotta nem állomásozik vagy épp csatázik, akkor a matrózok morálja csökken (15 percenként 1%-kal). Éppen ezért fontos bolygók körül állomásoztatni őket, ahol viszont nő a moráljuk, feltéve, hogy van kikötő a bolygón.</p>\r\n<p>Egy kikötő 100 egyenértéknyi matrózt bír kiszolgálni, ezt mutatja a kapacitás. Ha ennyi vagy ennél kevesebb űrhajó van a bolygó körül, akkor a matrózok morálja 15 percenként 10%-kal nő. Ha viszont kevés a kikötő, akkor a telítettség (vagyis a teljes flottaérték és a kikötőkapacitás hányadosa) 100% fölé nő, és a morálnövekedés üteme kisebb lesz, mert a matrózok sem szeretik a tolongást.', 'urkikoto', 'Űrkikötő', '', 'Space station'),
(1, 34, 'A teleport a csillagközi <a href="HELP_ROOT?domen=0&id=7">szállítás</a> és <a href="HELP_ROOT?domen=0&id=6">kereskedelem</a> elengedhetetlen feltétele, ezen keresztül kapcsolódnak a bolygók a tőzsdéhez és egymáshoz. A teleport egy féreglyukon keresztül küldi át az árut. Minél több áruról van szó, annál több ideig kell nyitva tartani a féreglyukat, ennek pedig jelentős kvantumenergia igénye van. Éppen ezért a teleport folyamatosan tölti a kvantumkondenzátorait (körönként 10 TT-vel, maximum 100 TT-ig), hogy amikor szükség van rá, ki tudja őket sütni. A fogadó oldalon nincs szükség teleportra, vagyis árukat venni vagy szövetségesektől kapni bárki tud.', 'teleport', 'Teleport', '', 'Teleport'),
(0, 2, '<p>Fent látható a bolygód neve. Tőle balra két nyíl, ezekkel tudsz végigfutni gyorsan a birodalmadon. A kulcs ikonra kattintva átnevezheted a bolygót. A csoport ikonnal közösbe lehet adni, ha tagja vagy szövetségnek, és 1-nél több saját bolygód van. A RESET-et csak akkor nyomd meg, ha az elején nagyon elrontottad a játékot, és szeretnéd újrakezdeni. Ekkor helyreáll az induló állapot (erőforrások, gyárak, népesség szempontjából). Ez csak a 0. tech-szinten érhető el. Jobb oldalt nagyban egy kép, valahogy így néz ki a bolygód.</p>\r\n<p>A név alatt, a képtől balra pedig a legfontosabb adatok:</p>\r\n<ul>\r\n<li><b>Tulajdonos</b>: kié a bolygó. A névre kattintva feljön az adatlapja. Ha közös tulajdonban van, akkor a szövetség neve, és zárójelben a kezelőé.</li>\r\n<li><b>Pozíció</b>: a bolygó koordinátái. Ha rákattintasz, a térkép oda ugrik, ahol a bolygó található.</li>\r\n<li><b>Osztály</b>: a bolygó osztálya. Rákattintva rövid összefoglalót kapsz az adott bolygóosztályról.</li>\r\n<li><b>Hold</b>: van-e holdja a bolygónak. Az árapályerőművek miatt fontos.</li>\r\n<li><b>Terület/beépített</b>: a bolygó felszínének teljes területe. Minél nagyobb, annál nagyobb ökoszférát bír el. Utána látszódik, hogy mennyit építettél be gyárakkal, városokkal. Zárójelben pedig, hogy ez a bolygó hány százaléka. A második szám zárójelben azt mutatja, hogy környezeti fejlesztéssel együtt mennyi a beépítettséged. Minél többet fejlesztesz, annál kisebb ez a szám a tényleges beépítettséghez képest.</li>\r\n<li><b>Környezet állapota</b>: ez a szám mutatja, hogy mennyi környezeti fejlesztést végeztek eddig a bolygón. Minél többet, annál több gyárat lehet építeni a bolygóra adott beépítettség mellett. 6 óránként egyszer tudsz fejleszteni a <a href="HELP_ROOT?domen=2&id=156">Környezeti KP</a> felhasználásával.</li>\r\n<li><b>Populáció</b>: a bolygó népessége. Ez a szám a kaja és a lakóhely függvénye, a kettő közül a kisebbhez tart. Ha változik, zárójelben látható, hogy mennyi lesz a következő körben.</li>\r\n<li><b>Kaja/termelés</b>: mennyi kaja van a bolygón készletben (ez határozza meg a népességet), és mennyi a termelés</li>\r\n<li><b>Lakóhely</b>: mennyi lakóhely van a bolygón. Ha változik a települések száma, zárójelben látható, hogy hány lakóhely lesz a következő körben.</li>\r\n<li><b>Munkaerő/igény</b>: az első szám a munkaerő mennyiségét mutatja, az a populáció fele. A második szám a gazdaság teljes munkaerőigényét, ez az aktív gyárak számától és típusától függ. Zárójelben a kettő hányadosa, vagyis hogy a mennyi munkaerő van a bolygón az igényekhez képest.</li>\r\n<li><b>Munkaerőhelyzet</b>: az előző sorban zárójelben lévő százalék grafikus ábrázolása:\r\n<ul>\r\n<li><b style="color:rgb(52,182,4)">95-100%</b>: optimális</li>\r\n<li><b style="color:rgb(156,218,4)">90-95%</b>: kissé laza</li>\r\n<li><b style="color:rgb(252,254,4)">75-90%</b>: nagyon laza</li>\r\n<li><b style="color:rgb(252,130,4)">75% alatt</b>: nem hatékony</li>\r\n<li><b style="color:rgb(180,42,4)">100% fölött</b>: beavatkozást igényel</li>\r\n</ul>\r\n</li>\r\n<li><b>Képzett munkaerő/igény</b>: az első szám a képzett munkaerő mennyisége, ez a városok számától függ. A második a képzett munkaerőigény, ez pedig a kutatóintézetek és hasonlók számától. Zárójelben a kettő hányadosa, vagyis hogy van-e elég képzett munkaerőd az igényekhez képest.</li>\r\n<li><b>Morál</b>: a bolygó lakosságának morálja. Ha kifosztják a bolygót, 20%-kal csökken. Ha eléri a nullát, elfoglalják, és 20%-kal nő. Egyébként pedig körönként 1%-kal nő.</li>\r\n<li><b>Ügynökök száma</b>: a bolygón képzett ügynökök száma és a maximális számuk. Utóbbi a hírszerző központok számától függ. Előbbi pedig körönként nő, ahogy képződnek az új ügynökök, és csökken, ha kiküldetésben vannak, és az ellenséges elhárítók likvidálják őket.</li>\r\n<li><b>Termelés</b>: minden bolygón körönként (15 percenként) van termelés, de ennek időzítése minden bolygón más. Itt láthatod, hogy ezen a bolygón mikor lesz legközelebb termelés.</li>\r\n</ul>\r\n<p>Alatta egy menü látható, amivel a bolygó aloldalait érheted el:</p>\r\n<ul>\r\n<li><a href="HELP_ROOT?domen=0&id=3">Ökoszféra</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=4">Gazdaság</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=5">Háború</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=6">Tőzsde</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=7">Szállítás</a></li>\r\n</ul>', 'screenshot_bolygo_sajat.png', 'Saját bolygó adatlapja', '', 'Profile of your planet'),
(2, 201, 'Az első exobolygók benépesítését és az EBSZ megalapítását követően nem kellett sokáig várni, hogy kiütközzék az ember harcias természete, s megépüljenek az első hadihajók. Hogy a kolóniák urai közötti őrült fegyverkezési versenynek valamelyest gátat szabjanak, az EBSZ vezetői egy sor megállapodást kötöttek, melyek pontosan szabályozták az akkori és a jövőben kifejleszthető űreszközök méretét, fegyverzetét és védelmi rendszereit. A kompromisszumok eredményeképp egy, a kor technológiai szintjének megfelelő harcászati űrhajótípus került kifejlesztésre. Az első generációs harci eszközök első képviselője az egyszerű felépítésű, titán páncélzattal és lézerágyúval felszerelt Könnyűcirkáló. Egyszerű és olcsó előállíthatósága folytán az újonnan benépesített planéták vezetői mind a mai napig előszeretettel használják a jó öreg Könnyűcirkálókat, hogy határaikat megvédjék, de az ugyanezen határokat fenyegető kalózvezérek szedett-vedett flottáiban is gyakran megfordul a típus, mivel a csúcstechnika teljes hiánya miatt adás-vétele ma már nem esik szigorú szabályozás alá.\r\nA Könnyűcirkáló hossza 74, szélessége 36, magassága 34 méter. Legénységét 9 flottatiszt, 6 gépész és 22 katona alkotja.', 'konnyucirkalo', 'Könnyűcirkáló', '', 'Light cruiser'),
(2, 202, 'A kolóniák vezetői hamar felismerték, hogy a cirkálók egymás elleni harca egy bizonyos flottaméret felett értelmetlen vérfürdőbe torkollik csupán. Természetesen nem az ellenség hajóit és katonáit sajnálta egyikük sem, hanem a saját népét. Ezért hát újra összeült az EBSZ, s megszavazták egy kifejezetten a cirkálók megsemmisítésére szánt űrhajó kifejlesztését. Az új típus a Skorpió fedőnevet kapta, s leginkább a régi idők vadászgépeire emlékeztetett. A mögöttes elgondolás lényege az volt, hogy a Skorpió, kihasználva apró méretét, közel repül a cirkálóhoz és rakétáival megtorpedózza azt. A fenti alapterv azután kiegészült dr. Lukas Wyczinski részecskefizikus új találmányával, a refraktorral. Ez a töltött részecskékből álló háló képes polarizálni és szétszórni a lézernyalábot alkotó fotonokat, szinte tökéletes védelmet biztosítva a Skorpiónak a cirkálók fegyverei ellen. További előnye a Skorpiónak, hogy a régi idők vadászkötelékeihez hasonlóan a formációs tréningen átesett pilóták az űrben is hatékonyan képesek segíteni egymást. A vadászgépek előállítási költsége kis méretük ellenére meghaladja a cirkálókét, mivel kompakt szerkezetük és a refraktoros védelem igen tiszta alapanyagokat és kifinomult gyártástechnológiát követel meg.\r\nA Skorpió hossza 9, szélessége 5, magassága 3 méter. Legénységét egy pilóta és egy lövész alkotja.', 'skorpio', 'Skorpió', '', 'Scorpion'),
(2, 203, 'Alig néhány év telt el a Skorpió kifejlesztése óta, az EBSZ vezetői újabb problémával szembesültek: a fejlettebb kolóniák vadászflottái egyszerűen elsöpörték a kevésbé fejlett cirkálórajokat, már-már a galaktikus egyensúly megbomlása fenyegetett. Sürgősen ellensúlyozni kellett hát a Skorpiók nyomasztó fölényét. A plazmatorpedók elleni védelem kérdését hamar sikerült megnyugtatóan rendezniük, az akkorra már galaxisszerte ismert és elismert Wyczinski professzor megtervezte a refraktor egy módosított változatát, az ionpajzsot. Ez már képes volt arra, hogy destabilizálja a plazmatorpedókat egyben tartó mágneses mezőket, így a hidrogénfúzió még jóval a hajótest előtt, a pajzs síkjában lejátszódott, szinte sértetlenül hagyva magát a burkolatot. Sajnos a lézerágyúkkal szemben gyakorlatilag semmiféle védelmet nem nyújtott a professzor találmánya, ám az EBSZ urai ezt elfogadható mértékű hátránynak ítélték azon előnyhöz képest, melyet a Skorpióktól való védelem jelent. A vadászelhárító űrhajó fegyverzetét a "kutyaharapást szőrivel" elv szem előtt tartásával alkották meg, magyarán ismét a jól bevált plazmatechnológiához nyúltak. Ez esetben azonban nem torpedót készítettek, hanem az ősidők kartácságyúihoz hasonló plazmavetőt. Ez szinte teljesen hatástalannak bizonyult a masszív titánpáncélzattal szemben, a tesztek során bebizonyosodott azonban, hogy a refraktor rései között az apró plazmaívek nagy része átszivárog és elérheti a Skorpió gyengébb felépítésű hajótestét, a kilőtt plazma széles terülése pedig biztosítja, hogy a vadász még egy elkerülő manőverrel se legyen képes kitérni a lövedék útjából. Ezen elgondolások mentén született meg a Fregatt, mely könnyű célpontot nyújt ugyan mindenféle cirkálónak, ám elsődleges feladatát, a vadászok elpusztítását hatékonyan el tudja látni.\r\nA Fregatt hossza 92, szélessége 44, magassága 30 méter. Legénységét 11 flottatiszt, 8 gépész és 23 katona alkotja.', 'fregatt', 'Fregatt', '', 'Frigate'),
(2, 204, 'Az EBSZ fegyverkezési korlátozásainak felülvizsgálatát voltaképpen azok tömeges megszegése indukálta. Tizennégy évvel a Fregatt prototípusának elkészülte után ugyanis a hat legfejlettebb kolónia vezetői titkos tanácskozást tartottak, melynek során megállapodtak egy, a Skorpiók ellen is eséllyel harcba szálló cirkálótípus kifejlesztéséről, az elavult Könnyűcirkálók helyett. Noha a vadászok ellen - változatlan lézer/titán alapkoncepciójának köszönhetően - az új hadihajó sem tudott maximális teljesítményt nyújtani, a Cirkáló nehézlézere és kétrétegű páncélzata elődje fegyverzeténél jóval hatékonyabbnak bizonyult. Midőn az EBSZ tudomást szerzett az egyezmény megszegéséről, súlyos döntési helyzetbe került: a cirkáló akkoriban szinte csodafegyvernek számított, mely kártyavárként söpri el az összes Fregattot és Könnyűcirkálót, nyílt háborút tehát nem kockáztathattak a hatok ellen, ám a többi, az egyezményt betartó kolóniát sem hozhatták hátrányba azzal, hogy nem engedélyezik számukra a felzárkózást. Végül újratárgyalták az egyezményt, s lefektették egy dinamikus rendszer alapjait, mely adott korlátok között bár, de lehetővé tette újabb és újabb hadihajók kifejlesztését, s amely megállapodás a mai napig is érvényben van.\r\nA Cirkáló hossza 119, szélessége 45, magassága 38 méter. Legénységét 11 flottatiszt, 10 gépész és 29 katona alkotja.', 'interceptor', 'Interceptor', '', 'Interceptor'),
(2, 205, 'Az újratárgyalt szerződés egyebek mellett a másik két hajóosztály továbbfejlesztését, illetve további második generációs hadihajók megépítését is engedélyezte, amely lehetőséggel a többségében militarista beállítottságú vezetők rövid időn belül éltek. A Skorpiót vették alapul a tervezés során melynek számos szerkezeti és műszaki problémáját felülvizsgálva egy új, tökéletesebb hajótesthez, a Vadászhoz jutottak. Védelem gyanánt megtartották a jól bevált Wyczinski-refraktort, a plazmatorpedókat pedig a nagyobb plazmahőmérsékletet, így a megnövekedett romboló kapacitás mellett jelentősen nagyobb fényintenzitást is produkáló fotontorpedókra cserélték. Természetesen a flották formációs tréningje rövid időn belül idomult az új, gyorsabb és erősebb vadászgép sajátosságaihoz, így a rajok megnövekedett támadó kapacitása erre a típusra is jellemző.\r\nA Vadász hossza 12, szélessége 7, magassága 3 méter. Legénységét egy pilóta, egy navigátor és egy lövész alkotja.', 'csatahajo', 'Csatahajó', '', 'Battleship'),
(2, 206, 'A Romboló az egyetlen második generációs hadihajó, mely nem csupán első generációs elődjének áttervezett és továbbfejlesztett változata, hanem valóban új terv. A Fregatt számos hibáját látva a mérnökök úgy döntöttek, elölről kezdik az egész tervezési munkát. Ennek meg is lett az eredménye: a Romboló prototípusa alig fél évvel az első harmadik generációs űrhajóé előtt készült el, így a típus szinte már a kifejlesztésekor elavult, mindazonáltal vadászelhárító űrhajóként a mai napig sok helyen használják - tekintve, hogy nem áll rendelkezésükre jobb. A Romboló testét a Fregattéhoz hasonló ionpajzs védi, a vadászok pusztításáért pedig a plazmavető továbbfejlesztett változata, a plazmatikus reticulumnak elkeresztelt fegyver felel, mely a plazmaíveket olyan elrendezésben lövi ki, hogy azok egy hálót alkossanak, így csökkentve még tovább a megtámadott vadász menekülési és túlélési esélyeit.\r\nA Romboló hossza 123, szélessége 47, magassága 39 méter. Legénységét 11 flottatiszt, 11 gépész és 30 katona alkotja.', 'szonda', 'Szonda', '', 'Probe'),
(2, 207, 'A hatok laboratóriumaiban Rombolóval szinte egyidőben láttak neki egy új cirkálótípus kifejlesztésének, hogy az elavulófélben lévő Cirkálókat lecseréljék flottáikban. A konkrét tervezési munkálatokat az EBSZ szabályzat tüzetes tanulmányozása és hosszas viták előzték meg. Abban mind megegyeztek, hogy az új hadihajó védelmi kapacitását leghatékonyabban a kazettás szerkezetű reaktív titánpáncélzattal tudják feljavítani elődjééhez képest, ám a fegyverzet tekintetében már korántsem mutatkozott ekkora egység: a tudósok egyik tábora a nehézlézer-technológia továbbfejlesztése mellett tört lándzsát, ám ez óriási energiaigénye folytán a korábbinál jóval nagyobb generátorokat kívánt volna meg. A másik oldal ezért alternatív technológiában, így kisebb, kompaktabb hajókban gondolkodott. Végül a hatok vezetői úgy döntöttek, mindkét elképzelésnek teret adnak, hátha hasznosnak bizonyulnak. A kompakt tervezés eredménye lett az Interceptor, ez a korszerű vonalvezetésű, elődjénél alig nagyobb méretű cirkáló. Fegyverzetének kialakításakor a kevéssé hatékony, ám csekély energiaigényű könnyűlézerekhez nyúltak vissza. Ebből készítettek 4x4-es elrendezésű ütegeket, valamelyest javítottak az eredeti fegyverek pocsék lőtávolságán, s a fegyverrendszert elnevezték falanx lézernek. Folytak kísérletek az irányban is, hogy a Könnyűcirkálókat ellássák falanx lézerekkel, ám gyönge szerkezetük a tesztek szerint nem bírta volna el az új lézerágyú-rendszert, így azokat csupán az Interceptoron sikerült rendszeresíteni. A nagyszámú, apró fegyver azután nem várt eredményeket mutatott fel a csatatéren. Az apró, gyors falanxok segítségével ugyanis hatékonyan el lehetett téríteni az Interceptorok felé tartó lövedékeket, s az ellenséges hajók zárótűz alá vonása is jóval egyszerűbbnek bizonyult, mint a nagyobb, ám éppen ezért kisebb számú és lassabb fegyverekkel. A taktikusok hamar kidolgozták azt a formációt, amelyben a leghatékonyabban ki tudják használni ezen adottságaikat az Interceptorok, így ez lett az első típus, amely kötelékben offenzív és defenzív téren is hatékonyságnövekedést tud felmutatni.\r\nAz Interceptor hossza 126, szélessége 50, magassága 40 méter. Legénységét 12 flottatiszt, 13 gépész és 32 katona alkotja.', 'cirkalo', 'Cirkáló', '', 'Cruiser'),
(2, 208, 'A harmadik generációs űrhajópark második tagja a Csatacirkáló, mely a hatok berkeiben megszületett alternatív elgondolás eredménye. A tudósok a reaktív titánpáncél mellett itt a nehézlézer-technológia továbbfejlesztését szorgalmazták, amely végül az impulzuslézer megalkotásában realizálódott. A minden korábbinál hatalmasabb generátorok ellenére a folyamatos üzemű szupernehéz lézer kivitelezhetetlennek tűnt, mivel a hatalmas energia kiégette volna a fókuszáló kristályokat és a LEDeket, ezért a lövéseket összesen öt, ezredmásodperc hosszúságú impulzusra és közöttük tizedmásodpercnyi szünetekre osztották. Így sikerült megakadályozni a fegyverrendszer gyors túlterhelődését, s hatékony, bár nagy energiaigényű lézerágyút létrehozni. Kombinálva a továbbfejlesztett fegyverirányító rendszerekkel, a pulzuslézer a falanxhoz hasonló eredményeket tudott elérni a zárótüzek kivitelezésében. Fedezőtűzre sajnos nem bizonyult alkalmasnak, ám a megrendelőket ezért bőven kárpótolta a nagyobb tűzerő és a Csatacirkáló puszta méreteiből fakadó addig példátlan ellenálló képessége.\r\nA Csatacirkáló hossza 209, szélessége 91, magassága 58 méter. Legénységét 18 flottatiszt, 23 gépész és 49 katona alkotja.', 'vadasz', 'Vadász', '', 'Fighter'),
(2, 209, 'A harmadik generáció csúcstechnológiáját tisztelhetjük ebben a monstrumban. Kifejlesztése meglepő módon nem a hatok nevéhez fűződik, hanem egy feltörekvő kolónia tehetséges uralkodójához, akinek tudósai egy szerencsés véletlen folytán fölfedezték, hogy a planétájukon előforduló ciszteit nevű ásvány kristályai lenyűgöző hatékonysággal fókuszálják az elektromágneses spektrum magasabb frekvenciájú tartományát, azaz a röntgen-, gamma- és kozmikus sugarakat. Innen már egyenes út vezetett az elgondoláshoz, hogy nagy mennyiségű gamma-aktív izotóp sugárzását fókuszálva a lézerhez hasonló (foton alapú), ám annál jóval erősebb fegyverhez juthatnak. Sajnos a tervezési munkálatok során kiderült, hogy a rekord erejű ágyú rekord méretű hordozót fog megkövetelni, a radioaktív anyagok biztonságos tárolása és utánpótlásuk biztosítása ugyanis rengeteg helyet és energiát igényel, nem beszélve a fegyver már önmagában is impozáns méreteiről. Eme szükséghelyzetből született meg az addigi legnagyobb űreszköz, a Csatahajó terve, melynek védelmét az akkor elérhető legfejlettebb páncélzat, a reaktív titán biztosította. A gammaágyút később átépítették, hogy folyamatos és impulzus-üzemmódban is képes legyen tüzelni, így nyervén még hatékonyabb ostrom- és tömegpusztító fegyvert. A Csatahajók megjelenése aztán drámai hatással volt a Galaxis erőegyensúlyára. Kiemelkedett a tömegből egy fejlett világ, akit azonban nem kötöttek a hatok belső paktumai, melyek a békét őrizték, csupán az EBSZ jóval enyhébb szabályai. Rövid mérlegelés után meglépték hát az adott helyzetben leginkább logikusnak tűnő lépést: felvették maguk közé az új nagyhatalmat, így kényszerítvén rá a korlátozásokat, a hatok pedig immár hetekként folytatták titokzatos terveik kivitelezését.\r\nA Csatahajó hossza 432, szélessége 155, magassága 94 méter. Legénységét 32 flottatiszt, 60 gépész és 118 katona alkotja.', 'rombolo', 'Korvett', '', 'Corvette'),
(2, 210, 'A hetek több, mint két évtizeden keresztül sikeresen megtartották maguknak a Csatahajó terveit, Wyczinski professzor 97 éves korában bekövetkezett halála pedig szinte befagyasztott mindennemű vadászokkal és rombolókkal kapcsolatos kutatást. A tűzerőfölény és a professzor elvesztése alapvető paradigmaváltást eredményezett. Immár nem a minél nagyobb tűzerő elérése volt a céljuk, hanem hatékony felderítő és támogató eszközök kifejlesztése, amelyek kifinomultabbá tehetik a hadviselést. A sokasodó kalóztámadások miatt a legsürgősebb fejlesztés vitán felül a felderítő szonda kifejlesztése volt. A felderítő láthatatlanságát az elméletben már évtizedek óta létező Kirchoff-pajzs biztosította, mely a kozmikus háttérsugárzáséval megegyező spektrumú sugárzást bocsátott ki, ezáltal beleolvadva a téridő finom szövetébe. Sajnos a szondával valamiféle kommunikációt fenn kell tartani, s ezt a bolygók nagy teljesítményű radarállomásai képesek bemérni, ám az űrhajók korlátozott hatótávú szenzorai nem, így mélyűri felderítésre kiválóan alkalmas az eszköz. A Kirchoff-pajzs másik nagy hátránya, hogy érzékeny felépítése miatt nem teszi lehetővé erős sugárzások és anyagi testek kibocsátását, így hadihajókra nem lehetséges felszerelni.\r\nA Szonda hossza 5, magassága és szélessége 2 méter, legénysége nincs.', 'fulgur', 'Fulgur', '', 'Fulgur'),
(2, 211, 'Az új szemléletmód második terméke a flottákat támogató űrhajó volt, a Koordinátor. Voltaképpen egy Cirkáló hajótestet építettek át a speciális célra. Védelmét vékony titánpáncélzat látja el, fegyverzetét pedig könnyű lézerágyúk alkotják. Tervezői igyekeztek minimálisra csökkenteni a felszerelések energiafogyasztását és tömegét, a Koordinátor ugyanis nem első vonalbeli hadihajó. Igazi jelentőségét a fedélzeten tartózkodó admirális és taktikusi csapata, illetve a gépházban szolgálatot teljesítő, jól képzett mérnökök adják. Ez a kreatív csapat képes a flotta bármely űrhajóját hatékonyabbá tenni azáltal, hogy magas szintű műszaki és taktikai iránymutatással látják el őket. Ez a látszólag különös elgondolás aztán drasztikus hatékonyságnövekedéssel járt: néhány Koordinátor a flotta bármely hadihajóját képes a fizikailag és műszakilag lehetséges maximumra, az alap támadási potenciál duplájára erősíteni, így akár egy generációval fejlettebb űrhajókat felvonultató ellenféllel is eséllyel szállhatnak szembe. A Koordinátorok egyetlen hátrányának sebezhetőségük bizonyult, amelyet sajnos azóta sem sikerült kiiktatni.\r\nA Koordinátor hossza 123, szélessége 52, magassága 40 méter. Legénységét 24 flottatiszt, 24 gépész és 10 katona alkotja.', 'dreadnought', 'Dreadnought', '', 'Dreadnought'),
(2, 212, 'A Szonda és a Koordinátor sikerei nyomán fölmerült az igény egy olyan űrhajó iránt, amely egész flottákat képes hatékonyan megóvni. A megvalósítás végül akkor vált lehetővé, mikor az egyik kísérleti részecskegyorsítóban sikerült nullás spinű Higgs-bozonokat előállítani. Ezen részecskék már eléggé erős és kiterjedt pajzsot generáltak ahhoz, hogy az egész flotta védhetővé váljék. A pajzsot egy fegyvertelen, Csatacirkálóból átalakított hajótestre szerelték fel. Sajnos elég hamar kiütközött az OH-pajzs hátránya: a lövések energiáját elnyelő bozonok visszacsatolást idéznek elő a generátorban, mely létrehozta őket, így az OH-generátorok egy idő után túlterhelődnek, az egész hajó pusztulását okozva. Ennek fényében a mérnökök javarészt automatizálták az OHS-1 rendszereit, hogy a típus minél kevesebb emberélet kockáztatásával óvhassa meg a flottát.\r\nAz OHS-1 hossza 207, szélessége 90, magassága 75 méter. Legénységét 4 flottatiszt és 11 gépész alkotja.', 'koordinator', 'Koordinátor', '', 'Coordinator'),
(2, 213, 'A negyedik generáció egyetlen valódi hadihajója voltaképpen nem egyéb, mint az OHS-1 fejlesztésének mellékterméke. Miközben a mérnökök az OH-pajzsrendszer finomhangolásán dolgoztak, felfedezték a Higgs-bozonok amplitúdómoduláló hatását, amelyet aztán megpróbáltak beépíteni a létező fegyverrendszerekbe. Akkoriban csak az impulzuslézert sikerült módosítani, a moduláció jelentősen megnövelte a tűzgyorsaságot és a pontosságot. Az így kapott turbólézereket egy új, a Csatahajó tervei alapján készült, de cirkáló osztályú űrhajóra szerelték föl, a kissé már idejétmúlt, de egyelőre hatékonyabb utód nélküli reaktív titánpáncélzattal együtt. A Nehézcirkáló már a kezdetektől fogva komoly műszaki problémákkal küzdött, s alig néhány évvel később teljesen föl is váltotta a fejlettebb, megbízhatóbb Fulgur.\r\nA Nehézcirkáló hossza 498, szélessége 176, magassága 103 méter. Legénységét 34 flottatiszt, 67 gépész és 133 katona alkotja.', 'nehezcirkalo', 'Nehézcirkáló', '', 'Heavy cruiser'),
(2, 214, 'Az ötödik generáció számos újítást hozott a haditechnikában. Az elmúlt évtizedekben kiforrott számos ifjú lángelme, s immár készen álltak arra, hogy betöltsék a Wyczinski professzor halálával keletkezett űrt. Ezt a korszakot három kiváló mérnök és három kiváló űrhajó neve fémjelezte. A cirkáló osztály továbbfejlesztése Orosházi Kálmán professzor nevéhez fűződik, aki elsőként épített hiperhajtóművet. Ez az új rendszer szakított a térgörbítés hagyományaival, s a görbült tér létrehozása helyett rácsatlakozik az egész Univerzumot behálózó féregjárat, rendszerre, s energiáját csupán arra használja, hogy alkalmas helyen be-, illetve kijáratot nyisson a hajó számára. Mivel meghajtórendszere speciális avionikát követel meg, ezért a Nemesist leszámítva mind a mai napig egyetlen hajótípuson, a Fulgur osztályú nehézcirkálón található térhajtómű, kiválóan alkalmassá téve ezzel a hajót távolsági csapásmérésre. A Fulgur fegyverzetét a Nehézcirkáló turbólézerei adják, védelmét pedig speciális, gerjesztett állapotú titánból, tritanitból készült páncélzat. A tritanitot ugyanaz a sötét energia tartja gerjesztett állapotban, amely stabilizálja a Fulgur hajtóműrendszerét - és egyebek mellett a fekete lyukakat. Ez az energia állandó vibrálásban tartja a Fulgur alakját, melyet így nehezebb észrevenni és eltalálni, ráadásul több, egymáshoz közeli Fulgur páncélzatának rezgései összehangolhatóak. Ebben a rezonanciaállapotban a gerjesztések egymást erősítik, így az Interceptor önfedező képességéhez hasonló, ám annál jóval nehezebben megmagyarázható effektus lép fel. A katonákat természetesen nem érdeklik a bonyolult részecskefizikai okfejtések és levezetések, nekik csak egy számít: sok Fulgur egy helyen = plusz védelmi potenciál az összes érintett egységnek.\r\nA Fulgur hossza 703, szélessége 188, magassága 104 méter. Legénységét 62 flottatiszt, 111 gépész és 247 katona alkotja.', 'raptor', 'Raptor', '', 'Raptor'),
(2, 215, 'Isoroku Kyamoto a régi idők repülőgép-hordozóinak nyomán alkotta meg terveit, melyek az addig felépített legnagyobb hadihajóról szóltak. Az Anyahajó mögötti elgondolás lényege az volt, hogy egy bármilyen típusú hadihajó ellen bevethető és semmilyen fegyver által nem sebezhető harcászati eszközt nyerjenek. Ennek megfelelően a tekintélyes fegyverzetben helyet kaptak a gammaágyúk és pozitrontorpedók ugyanúgy, mint néhány plazmatikus reticulum. A védelem kérdése már bonyolultabb volt: az addig ismert védelmi rendszerek mind specifikusan egy adott osztály ellen készültek, Kyamoto professzornak pedig egy általánosan használható eszközre volt szüksége. Végül hosszas kísérletezés után a reaktív titánpáncélzat továbbfejlesztésével kapott ablatív titánréteg és a refraktor kombinációja mellett döntött. Bár így mindkét rendszer elveszítette specifikus előnyeit, egyúttal hátrányaik is megszűntek. Az Anyahajót óriási mérete és borsos ára miatt kezdetben még a hetek sem mind gyártották, ám idővel mind rájöttek, hogy az apró termetű japán mérnök találmánya a legkiválóbb hadihajók egyike.\r\nAz Anyahajó hossza 1119, szélessége 335, magassága 201 méter. Legénységét 155 flottatiszt, 387 gépész és 900 katona alkotja.', 'csatacirkalo', 'Romboló', '', 'Destroyer');
INSERT INTO `leirasok` (`domen`, `id`, `leiras`, `kep`, `cim`, `leiras_en`, `cim_en`) VALUES
(2, 216, 'Dr. Norman Wayne tervei alapján készült el az immár évtizedek óta várt új generációs vadászgép, melynek kifejlesztését a hetek kezdettől fogva támogatták. A Raptor fedőnevet kapott űrhajó egyesítette magában az elmúlt korok számos, jól bevált technológiáját: a refraktor és az ionpajzs finomhangolt kombinációjával létrehozták a lézerek mellett a rombolók plazmaíveit is hatékonyan távol tartó refraktoros ionpajzsot, a meghajtórendszerbe pedig beépítették a térhajtómű egy gyengébb teljesítményű verzióját. Bár tényleges féregjárat-ugrást nem sikerült elérni, sem önfedező hatást, a gerjesztett spinállapotú hajótest jelentősen csökkentette a Raptor érzékelhetőségét, sebességét pedig megnövelte. Fegyverzet gyanánt pozitrontorpedót szereltek föl a vadászra, melynek elkészítését egy új felfedezés, a hipermágnes tette lehetővé - egyedül ez képes ugyanis olyan erejű és szimmetriájú mágneses mezőt generálni, amely akár évekig stabilan elkülöníti egymástól az anyagot és az antianyagot. A Raptor azóta is a vadásztechnológia csúcsának számít, máig sem sikerült jobbat építeni nála.\r\nA Raptor hossza 14, szélessége 6, magassága 3 méter. Legénységét egy pilóta, egy navigátor és egy lövész alkotja.', 'anyahajo', 'Anyahajó', '', 'Carrier'),
(2, 217, 'A militarista heteknek a Fulgur minden előnye dacára sem felelt meg, kevesellték a tűzerejét. Megkörnyékezték hát mindhárom híres mérnököt, hogy tervezzenek meg egy még nagyobb és még erősebb csatahajót, ám ők megsértődtek, hogy addigi életük főműve nem elég jó a vezéreknek, s nem vállalták a munkát. Végül egy közepesen ismert tudósokból álló, több ezres létszámú kutatócsoportra bízták az új hadihajó megtervezését. Amint az várható volt, a sok jó iparos jó munkát végzett, kiváló harcászati eszköz került ki a kezeik alól, ám nélkülözte az ötödik generációs hajók specialitásait, nem viselte magán egy lángelme keze nyomát sem. Ugyanolyan volt, mint a legtöbb cirkáló és csatahajó - természetesen nagyobb, erősebb volt mindnyájuknál, de ennyiben ki is merült a különlegessége. Mindezek ellenére botorság lenne lebecsülni vagy nem rendszerbe állítani a rettegett Dreadnoughtot, ezt hamar megtanulta az egész Galaxis. Az ablatív titánpáncélzat és a tucatnyi refókuszált gammaágyú félelmetes tűzerőt képvisel akkor is, ha egyesek túl közönségesnek találják a hajó felépítését.\r\nA Dreadnought hossza 1536, szélessége 678, magassága 502 méter. Legénységét 295 flottatiszt, 777 gépész és 1984 katona alkotja.', 'nemesis', 'Nemesis', '', 'Nemesis'),
(2, 218, 'Évtizedek teltek el a Dreadnought kifejlesztése óta, s úgy tűnt, ennél erősebb hadihajóra már a heteknek sem lesz szüksége. A Galaxis, bár állandóan forrongott, végre egyensúlyba jutott, s úgy tűnt, az emberiségre többé-kevésbé békés évszázadok várnak. Ebbe a kvázi-idillbe rondított bele rútul Zandagort hadüzenete. Hatvan esztendeje először a teljes EBSZ összeült, hogy megbeszéljék a továbbiakat. Tudták jól, hogy ez a hadüzenet nem tréfadolog, felkészülten kell várniuk az inváziós seregeket. Bár nem tudták, milyen technikai színvonalon áll az ellenség, mindenképpen ki kellett fejlesszenek egy csodafegyvert, egy végső megoldást, ami eséllyel szállhat szembe gyakorlatilag bármilyen fenyegetéssel. Visszahívták hát a három legendás, jól megérdemelt nyugdíjas éveiket töltő mérnököt, hogy a vezetésükkel megtervezzék az emberiség zászlóshajóját. Tizenöt esztendeig tartó lázas munka vette kezdetét, melynek során tervek százait készítették és vetették el. Végül egyetlen elképzelés maradt talpon, mely a Nemesis fedőnevet kapta. A gigászi csillaghajó meghajtásáért az Orosházi-féle térhajtómű felel - kisebb hajtómű meg sem bírná mozdítani a Nemesist, még így is alig képes a Fulgur sebességének negyedével haladni. Védelmét az eddigi technológiák teljeskörű ötvözésével megalkotott energia-nanoháló látja el, fegyverzetét pedig számos refókuszált gammaágyú és túltöltött plazmatikus reticulum mellett a három lángelme közös találmánya, a müonkatapult alkotja. Ez a toronyháznyi méretű eszköz kvarkszintű részecskereakciók során több tonnányi különösen instabil müont generál, majd az egészet az ellenséges hajóra zúdítja. Ez a részecsketömeg késként hatol át az OH-pajzson és minden ismert védelmen, a rendelkezésre álló űreszközök közül egyedül egy másik Nemesist nem hasít ketté egyetlen lövéssel. Sajnálatos módon horribilis előállítási költségei okán igen kevés készült el belőle mostanáig, Zandagort inváziós flottája pedig egyre közeleg. Ki tudja, vajon elég erős lesz-e az emberiség, hogy megállítsa őket?\r\nA Nemesis hossza 4119, szélessége 1037, magassága 1012 méter. Legénységét 1083 flottatiszt, 3902 gépész és 17015 katona alkotja.', 'ohs-1', 'OHS-1', '', 'OHS-1'),
(0, 3, '<p>Az ökoszféra menüpont alatt láthatód a bolygó ökoszféráját. Egymás alatt találhatók sorban a növények, a növényevők és a ragadozók. Mindegyik fajnál van egy kis kép, erre kattintva rövid leírást olvashatsz róla. A képtől jobbra van a faj neve, mellette pedig egy szivárvány ikon. Ez a Galaktikus Génbank hívógombja. Ha kihal egy faj, kattints rá, és a felugró ablakban add meg, hogy mennyi kérsz belőle. Az egyes fajok ára a trofikus szintjükön múlik: a növények/gombák ára 100 SHY/hektár, a növényevőké 1000 SHY/darab, a ragadozóké 10 000 SHY/darab.</p>\r\n<p>A név alatti csík mutatja, hogy mennyi van az adott fajból. A csík színe és hossza jelzi, hogy mennyivel van kevesebb a "szűz" állapothoz képest (amikor nem terheli semmilyen gazdaság az ökoszférát):</p>\r\n<ul>\r\n<li style="color:rgb(52,182,4)">90% fölött sötét zöld</li>\r\n<li style="color:rgb(156,218,4)">67%-tól 90%-ig sárgás zöld</li>\r\n<li style="color:rgb(252,254,4)">50%-tól 67%-ig sárga</li>\r\n<li style="color:rgb(252,130,4)">33%-tól 50%-ig narancs</li>\r\n<li style="color:rgb(180,42,4)">33% alatt piros</li>\r\n</ul>\r\n<p>A csíkon lévő szám a faj népességét adja (növényeknél hektárban, állatoknál darabszámban), a zárójelben lévő százalék pedig azt, hogy a szűz állapot hány százalékán áll az adott faj.</p>\r\n\r\n<h2>Beépített ökoszimulátor</h2>\r\n<p>Ez egy PRÉMIUM szolgáltatás, amivel kényelmesen meg lehet nézni, hogy hova fejlődik az ökoszféra a bolygódon adott ipar mellett. A sima ökoszimulátorral szemben:</p>\r\n<ul>\r\n<li>automatice beimportálódnak a bolygód adatai,</li>\r\n<li>a kitermelést a gyárak számával adhatod meg,</li>\r\n<li>az eredménynél azt is látod, hogy mennyi ipari output (energia, élelmiszer) keletkezne így,</li>\r\n<li>és 10 napra előre lehet szimulálni.</li>\r\n</ul>\r\n<p>Használata egyszerű: a bolygó ökoszféra menüjében található. Bal oldalra lehet beírni, hogy mennyi van az egyes élőlényekből, alá pedig, hogy mennyi az egyes gyárakból (itt a bal oldali ikon a gyárat jelzi, a jobb oldali a felhasznált inputot). Középen megadhatod, hány napot szeretnél szimulálni, majd a "Mehet!"-re kattintva (kis várakozás után) megjelenik a grafikon. Itt minden sorban a középső halvány vonal a 100%-ot jelenti (a szűz állapothoz képest). A vonal színe pedig ugyanolyan, mint az ökoszféránál a jelző csíkok (lásd fentebb).</p>\r\n<p>A függőleges erős vonalak a napokat, a halvány vonalak a negyed napokat (6 óra) jelzi.</p>\r\n<p>Az eredmény jobb oldalt jelenik meg darabszámban (növény esetén hektárban) és százalékban. Alatta pedig a megtermelt erőforrások (élelmiszer, alkohol, fa, energia).</p>\r\n<p>A szimuláció bemenetét többféleképp módosíthatod:</p>\r\n<ul>\r\n<li>ha újra töltődik a bolygó adatlapja (pl a bolygó nevére kattintasz), akkor az aktuális állapot íródik be</li>\r\n<li>ha az "ökoszféra input <- szimuláció eredménye" linkre kattintasz, akkor a szimuláció eredménye íródik be, így lehet pl 10 napnál hosszabb előrejelzést tenni</li>\r\n<li>ha az "ökoszféra input <- tényleges" linkre, akkor az élőlények száma visszaíródik a ténylegesre</li>\r\n<li>ha az "ipar <- tényleges" linkre, akkor, akkor a gyárak száma visszaíródik a ténylegesre</li>\r\n<li>kézzel átírhatod bármelyik számot, így tudsz tetszőleges forgatókönyvet kipróbálni</li>\r\n</ul>\r\n<p>Így könnyen ellenőrizhető, hogy hány húsüzemet bírnak el mondjuk a pandáid (ez bolygómérettől függ, de keveset). Vagy ha pl <a href="HELP_ROOT?domen=-1&id=5">E-osztályú</a> bolygód van, akkor mekkora medvekitermelésnél kezd instabilizálódni az egész ökoszférád (a medve az egyik <a href="HELP_ROOT?domen=2&id=56">leghatékonyabb</a> élelmiszerforrás).</p>', 'screenshot_okoszfera_v2.png', 'Saját bolygó adatlapja#Ökoszféra', '', 'Profile of your planet#Ecosystem'),
(0, 4, '<p>A gazdasági aloldal két fő részből áll: balra láthatod a gyárakat, jobbra az erőforrásokat.</p>\r\n\r\n<h2>Gyárak</h2>\r\n<p>Balra legfelül vannak a gyárak, soronként egy típus. Mindegyiknél a kis képre kattintva felugrik a hozzá tartozó help. Az aktív (üzemel) oszlopban lévő számok azt mutatják, hogy hány aktív gyárad van az adott típusból. Ha erőforráshiány miatt nem tud mindegyik üzemelni, akkor zárójelben pirossal az üzemben lévők száma látható. Ekkor érdemes megnézned, hogy milyen erőforrásokat használ az adott gyár, és jobb oldal megkeresni, hogy melyikből van hiány (ami piros). Van még egy oszlop: az inaktív gyárak száma. Ebben csak ott szerepel szám, ahol van inaktív üzem. Akkor érdemes inaktiválnod épületeket, ha pl be akarod osztani, hogy egy szűkös erőforrást ki használjon.</p>\r\n<p>Ha rákattintasz egy gyár sorára, legördül egy menü, ahol a következőket láthatod:</p>\r\n<ul>\r\n<li><b>aktivál</b>: rákattintva annyi gyárat aktiválsz, amennyi a mellette lévő mezőbe van írva (alapértelmezésben az összeset, de átírhatod)</li>\r\n<li><b>inaktivál</b>: rákattintva annyi gyárat inaktiválsz, amennyi a mellette lévő mezőbe van írva</li>\r\n<li><b>Fogy</b>: miből mennyit fogyaszt egy ilyen típusú gyár (a "k" az 1000-nek a rövidítése)</li>\r\n<li><b>Term</b>: miből mennyit termel egy ilyen típusú gyár</li>\r\n<li><b>épít</b>: rákattintva annyi gyárat építesz, amennyi a mellette lévő mezőbe van írva (alapértelmezésben 1-et, de átírhatod)</li>\r\n<li><b>inaktívat épít</b>: rákattintva annyi inaktív gyárat építesz, amennyi a mellette lévő mezőbe van írva (alapértelmezésben 1-et, de átírhatod). A különbség az építéshez képest az, hogy amikor ezek a gyárak megépülnek, inaktívak lesznek (ez akkor hasznos, ha nem tudod előre, hogy milyen lesz az erőforráshelyzet). A már épülő gyárakat is lehet aktiválni/inaktiválni menet közben.</li>\r\n<li><b>10k Fa, 6k Kő...</b>: miből mennyi kell egy gyár megépítéséhez</li>\r\n<li><b>óra ikon</b>: mennyi idő alatt épül meg egy ilyen típusú gyár</li>\r\n<li><b>lerombol</b>: rákattintva annyi gyárat rombolhatsz, amennyi a mellette lévő mezőbe van írva (alapértelmezésben 1-et, de átírhatod). A dózerolás ideje az építési idő 10%-a. Ezalatt egy külön listában láthatod, hogy milyen épületek állnak rombolás alatt, mennyi idő múlva "készülnek" el, és hány %-on állnak. Ha leállítod a dózerolást, akkor a gyár az építési listába kerül. Ha 10%-on állítod le, akkor 90%-on kapod vissza (hiszen 10%-át romboltad le az épületnek, 90%-a áll még).<br />\r\nHa egy kész épületet lerombolsz, akkor az építőanyagok felét visszakapod. Ha egy épülőfélben lévő épületet, akkor annál többet (ha véletlenül kezdesz építkezni, és kapásból lebontod, akkor 100%-ot). Legtöbbször jobban jársz az inaktiválással, hiszen a gyár megmarad, és ugyanúgy nem fogyaszt semmit, mintha nem lenne (a beépítettséget viszont növeli). Felperzselt föld taktikája esetén, vagy ha már kezd nagyon tele lenni a bolygód, akkor hasznos a rombolás.</li>\r\n<li><b>x építhető most.</b>: PRÉMIUM szolgáltatás, megmutatja, hogy hányat tudnál építeni a jelenlegi készleteid alapján</li>\r\n<li><b>x kör múlva lesz hozzá elég építőanyag. Hiányzik: ...</b>: PRÉMIUM szolgáltatás, megmutatja, hogy hány kör múlva lesz elég nyersanyagot, hogy építs egyet a megadott gyárból, és tételesen felsorolja, hogy melyik erőforrásból mennyi hiányzik, és az hány kör alatt gyűlik össze</li>\r\n<li><b>sor elejére/végére</b>: PRÉMIUM szolgáltatás: az építési lista elejére/végére tudsz felvenni építési parancsot (ld. lentebb)</li>\r\n</ul>\r\n<p>A gyárak alatt látható az <b>Új épület</b> menüpont. Erre kattintva előjönnek az iparágak, azokra kattintva pedig az adott bolygón adott fejlettségi szint mellett elérhető gyártípusok. A "épít"-re kattintva annyit építhetsz belőle, amennyi a mezőbe van írva, az "inaktív"-ra kattintva pedig annyi inaktívat. Ezalatt az építéshez szükséges erőforrások és idő, majd a fogyasztás és termelés található.</p>\r\n<p>Ezalatt van a <b>dózerfélben</b> lévő épületek listája, ha van ilyen gyárad éppen. Itt látható, hogy még mennyi idő, amíg teljesen lerombolódik az épület, és hogy hány százalékon áll. Az X-re kattintva leállíthatod a bontást, ekkor az épület átkerül az épülőfélben lévők közé, de csak a lerombolt részeket kell újraépíteni.</p>\r\n<p>Ezalatt láthatók az <b>épülőfélben lévő gyárak</b>. Mindegyiknél ott van, hogy hány darab épül, és hogy mennyi idő múlva fog elkészülni. A százalék az X mellett azt mutatja, hogy hány százaléka készület el az épületnek. Az X-re kattintva leáll az építkezés, és a félkész épületet lerombolják, vagyis átkerül a dózerfélben lévő épületek közé. Az aktivál/inaktivállal tudod módosítani, hogy üzembe helyezéskor aktív vagy inaktív legyen a gyár.</p>\r\n<p><b>Építési lista</b>. Ezzel a PRÉMIUM szolgáltatással lehetővé válik, hogy már akkor kiadj építési parancsokat, amikor még nincs is elég erőforrás az adott gyár megépítéséhez. Ekkor az építési parancs egy listába kerül. A rendszer percenként ellenőrzi, hogy összegyűlt-e elég nyersanyag a legelső parancs (legalább részleges) végrehajtásához, akár azért, mert közben termeltél, akár azért, mert a tőzsdén vásároltál, vagy máshonnan szállítottak neked. Ha összegyűlt, akkor automatice elindul az építkezés. Ha csak részben, pl 10 vegagyárra van építési parancs, de csak 2-re van elég építőanyag, akkor 2 elkezd épülni, a maradék 8 marad a listában.</p>\r\n<p>A lista elemeit a fel/le nyilakkal tudod sorrendezni, a kulcs ikonnal szerkeszteni (hány darab), az X-szel törölni.</p>\r\n<p>A gyárak építésénél új opció jelent meg: ha nem építeni akarsz, hanem csak a lista elejére vagy végére beszúrni egy építési parancsot. Ha többet építenél, mint amennyire jelenleg lehetőség van, akkor csak annyi kezd épülni, amennyi tud, a többi a lista végére kerül.</p>\r\n<p>A listában van egy munkaerő oszlop. Ez kumulálva (vagyis sorban felösszegezve) mutatja a nettó munkaerő igényt. Vagyis ha a megadott sorrendben épülnének meg a gyárak (pontosabban az építkezések befejezése lenne a megadott sorrendben), akkor hogyan változna a munkaerőigény. Gyárak esetében ez a használt munkaerő mennyisége, településeknél ebből levonódik a lakóhelyek számának fele (hiszen a munkaerő a lakosság fele, a lakosság pedig követi a lakóhelyek számát, ha van elég élelmiszer). Ez utóbbi falu esetén -240, város esetén -14000.</p>\r\n<p>A lista előtt látszódik, hogy a lista legelső eleme legkorábban hány kör múlva tud elkezdeni épülni, és hogy mennyi erőforrás hiányzik hozzá.</p>\r\n<p>Fontos, hogy csak akkor indul el automatikusan egy építkezés, ha az építési költségek levonása után marad elég készlet a termeléshez is. Vagyis általában valamivel később, mintha kézi indítás esetén, ahol elég, ha a költség levonása után nulla vagy annál több készlet marad. Így az automatikus építkezés során sosem fog leállni vagy összeomlani a termelés, ha csak nem számítod el magad.</p>\r\n\r\n<h2>Erőforrások</h2>\r\n<p>Jobb oldalt láthatod a bolygó erőforrásait:</p>\r\n<ul>\r\n<li>Először egy kis kép, erre kattintva felugrik a help.</li>\r\n<li>Utána az erőforrás neve. Ha ez piros, akkor hiány van az adott erőforrásból, ami onnan is látszik, hogy bal oldalt a gyárak között van olyan, ahol az üzemelők száma kisebb, mint az aktívak száma. Ha narancssárga, az azt jelzi, hogy a készlet közel van ehhez a kritikus szinthez.</li>\r\n<li>A következő oszlopban van a készleten lévő mennyiség. Ez azért fontos, mert termeléskor a fogyasztás a készletekből történik, vagyis előbb levonódik a készletből a fogyasztott mennyiség, és csak utána adódik hozzá a termelt. Ha a készlet a raktárkapacitás (alapértelmezésben a bruttó termelés 500-szorosa) 90%-át meghaladja, akkor a készlet narancssárga, ha a 100%-át (vagyis betelik a raktár), akkor piros. Ez esetben a termelt fölösleg a szemétbe megy, érdemesebb tehát inkább építkezni belőle.</li>\r\n<li>PRÉMIUM szolgáltatás: ha a nettó termelésed pozitív, akkor a készlet alatt látszódik zölddel, hogy hány kör alatt fog betelni a raktár, vagyis legkésőbb mikor érdemes építkezned belőle, eladni a tőzsdén, vagy átküldeni más bolygóra. Ha a nettó termelésed negatív, akkor pedig pirossal látszódik, hogy hány kör múlva fog kifogyni a készlet. Vagyis ha nem akarod, hogy inaktiválódjanak gyárait, legkésőbb addig be kell avatkoznod.</li>\r\n<li>Ezután jön a bruttó termelés és fogyasztás, vagyis hogy a következő termeléskor mennyi fog fogyni és mennyi termelődik az adott erőforrásból.</li>\r\n<li>És végül az előző két szám különbsége, a nettó termelés. Ez zöld, ha pozitív (vagyis nő a készlet), és piros, ha negatív (vagyis csökken a készlet).</li>\r\n</ul>', 'screenshot_gazdasag_v2.png', 'Saját bolygó adatlapja#Gazdaság', '', 'Profile of your planet#Economy'),
(2, 156, 'Bár minden bolygónak véges az eltartóképessége, megfelelő környezeti kutatásokkal ez növelhető, így nagyobb népességet és ipart tud fenntartani.</p>\r\n<ul>\r\n<li>Minden bolygónak van egy környezeti állapota, ami megjelenik az adatlapján. Ez egy %-os érték, ami azt mutatja, hogy az effektív beépítettség mennyivel kisebb a ténylegesnél. Ha például 10%-ra építetted be a bolygódat, és a környzet állapota 3%-os, akkor ez olyan, mintha csak 7%-os lenne a beépítettség.</li>\r\n<li>A környezet állapotát 6 óránként legfeljebb 1-szer fejlesztheted, méghozzá úgy, hogy általad megadott Környezeti KP-t fordítasz rá. Ez egy alkalommal legfeljebb 1000 KP lehet. Ez a KP levonódik az eddig kikutatott KP-ból, és javítja a környezet állapotát.</li>\r\n<li>1% eléréséhez 50 KP kell, 2%-hoz 200 KP, 3%-hoz 450 KP, 4%-hoz 800 KP (általában x%-hoz 50x^2 KP kell), vagyis egyre több KP-t igényel a fejlesztés. Éppen ezért, ha több bolygód van, inkább érdemes mindegyikre költeni, mint csak egyet fejleszteni.</li>\r\n<li>A környezet állapota a bolygóhoz tartozik, függetlenül a tulajdonosától. Vagyis ha elfoglalsz egy környezetileg felfejlesztett bolygót, akkor számodra is megmarad a fejlettsége.</li>\r\n</ul>\r\n<p>', '', 'Építéstechnológia (kutatási téma)', '', 'Construction technology'),
(0, 5, '<p>A háború aloldalon a bolygón legyártott űrhajókat nézheted meg, felküldheted őket az űrbe harcolni, itt láthatók a bolygó körül állomásozó flották, és ezek viszonya a bolygó kocsmáihoz.</p>\r\n<h2>Legyártott űrhajók</h2>\r\n<p>Minden típusnál a kis képre kattinva felugrik a help, az adott típus leírásával. A vastagon írt szám jelzi, hogy hány hajót építettél, a +N% pedig azt, hogy ennyire van kész a következő épülő hajó. Minden hajó 100 HP-ból áll. Az űrhajógyár termelési adatainál az látható, hogy körönként hány HP-t gyárt le. Könnyűcirkálóból pl 35, ami azt jelenti, hogy 3 kör alatt 105, vagyis 1 egész hajó és még +5%.</p>\r\n<p>A +N%-tól jobbra látható mezőbe írhatod, hogy hány hajót szeretnél felküldeni az űrbe. A max-ra kattinva beíródik az adott típusból elérhető teljes mennyiség (fent a mindet-re kattintva pedig az összes típus maximális száma beíródik). Maga a fellövés az állomásozó flottáknál látható zöld nyilakkal megy.</p>\r\n<p>És végül az elkészült (vagyis fellőhető) hajók egyenértéke az adott típusban.</p>\r\n<h2>Állomásozó flották</h2>\r\n<p>Itt vannak felsorolva a bolygó körül állomásozó flották. Ezek védik a bolygódat, ha támad érné. Ha legyőzik az összes itt állomásozó flottát, akkor a bolygót kifosztják vagy elfoglalják, attól függően, hogy milyen magas a lakosság morálja. Ha itt rákattintasz valamelyikre flottára, bejön az adatlapja.</p>\r\n<p>Mindegyik flotta mellett található egy zöld kis nyíl. Ezzel tudod a fent megadott hajókat az adott flottába pakolni. Ha nincs flotta a bolygó körül, vagy újat akarsz létrehozni, akkor írd be a nevét a mezőbe (amitől jobbra áll, hogy "új"), és kattints a mellette lévő zöld nyílra. Ekkor a kijelölt hajók nem egy meglévő flottába kerülnek, hanem újat alkotnak.</p>\r\n<h2>Űrkikötő</h2>\r\n<p>Itt láthatod a bolygó körül állomásozó flották teljes egyenértékét. Minden hajótípusnak van egy saját egyenértéke, amit a help-ben megnézhetsz. Ez határozza meg az árát (vagyis hogy mennyi erőforrás kell a megépítéséhez), az építési idejét, csatában a morál és tapasztalat megváltozását, és itt a kocsmaigényét.</p>\r\n<p>Ha egy flotta a nyílt űrben álldogál, vagyis nem csinál semmit, akkor a matrózok morálja csökken (15 percenként 0,01%-kal). Éppen ezért fontos bolygók körül állomásoztatni őket, ahol viszont nő a moráljuk. (Őrjáratozás és egyéb tevékenység közben a morál változatlan.) Sőt, ha kocsma is van a bolygón, akkor még gyorsabban nő.</p>\r\n<p>Egy kocsma 100 egyenértéknyi matrózt bír kiszolgálni, ezt mutatja a kocsmakapacitás. Ha ennyi vagy ennél kevesebb űrhajó van a bolygó körül, akkor a matrózok morálja 15 percenként 1%-kal nő. Ha viszont kevés a kocsma, akkor a kocsmatelítettség (vagyis a teljes flottaérték és a kocsmakapacitás hányadosa) 100% fölé nő, és a morálnövekedés üteme kisebb lesz, mert a matrózok sem szeretik a tolongást.</p>\r\n<p>Mivel a szondának nincs legénysége, ezért nincs is morálja, és a kocsmákat sem terheli.</p>', 'screenshot_bolygo_haboru_v2.png', 'Saját bolygó adatlapja#Háború', '', 'Profile of your planet#War'),
(0, 6, '<p>A tőzsde oldalon legfölül láthatod a teljes vagyonodat SHY-ban (Shylock, ez a galaktikus pénzegység). Ezt használhatod arra, hogy vásárolj a tőzsdén erőforrásokat.</p>\r\n<p>Ezután következik a <a href="HELP_ROOT?domen=1&id=34">teleport</a> kapacitás: a bolygón található teleportok töltöttsége és maximális kapacitása. Utóbbi a teleportok számától függ. Előbbi pedig körönként nő, ahogy töltődnek a teleportok, és csökken, ha szállítasz valamit vagy eladási megbízást adsz a bolygóról.</p>\r\n<p>A nagy táblázatban erőforrásonként a következők szerepelnek:</p>\r\n<ul>\r\n<li><b>kép</b>: erre kattintva felugrik a help, és láthatod, hogy mi termeli és mi fogyasztja ezt az erőforrást</li>\r\n<li><b>erőforrás (célár)</b>: az erőforrás neve. Zárójelben, ha a Központi Bank folytat intervenciót, akkor a célár, vagyis legfeljebb amennyiért hajlandó vásárolni.</li>\r\n<li><b>utolsó kötés</b>: ilyen árfolyamon ilyen mennyiség cserélt utoljára gazdát a tőzsdén</li>\r\n<li><b>legmagasabb vételi ajánlat</b>: ha valaki venni akar egy erőforrásból, de túl alacsony árat ad meg, és nincs, aki ennyiért eladjon neki, akkor a vételi ajánlata felíródik a kereskedési könyvbe. Ezek közül a vételi ajánlatok közül a legjobbat, vagyis a legmagasabb árút láthatod itt. Ha ennyiért próbálsz eladni, biztosan sikerrel jársz. Ha ennél drágábban, akkor az ajánlatod felkerül a tőzsdére, a várakozók közé.</li>\r\n<li><b>legalacsonyabb eladási ajánlat</b>: az előzőhöz hasonlóan, ha valaki túl drágán próbál eladni, sikertelenül, akkor az ajánlat felíródik. Ezek közül látható itt a legjobb, vagyis a legolcsóbb. Ha ennyiért próbálsz venni, biztosan sikerrel jársz. Ha ennél is olcsóbban, akkor az ajánlatod felkerül a tőzsdére, a várakozók közé.</li>\r\n<li><b>saját és új ajánlatok</b>: itt láthatod a korábban megadott és várakozó ajánlataidat. Zölddel a vételieket, pirossal az eladásiakat. És vastagon, ha a legjobbak között van: vagyis a vételi a legdrágábbak, az eladási pedig a legolcsóbbak között. Ha nincs köztük, akkor csak úgy fog párt találni magának az ajánlatod, ha előbb a jobbakat elviszik előle, hiszen senki sem akar a legmagasabb ár fölött venni, vagy a legalacsonyabb ár alatt eladni.<br />\r\nA két mezőbe írhatod, hogy mennyit akarsz venni/eladni és milyen áron. Az árhoz az utolsó kötés ára van beírva alapból, de ezt szabadon módosíthatod. A V-re kattintva vételi, az E-re kattintva eladási ajánlatot adhatsz föl.<br />\r\nUtóbbihoz szükség van teleportra, hogy a tőzsdére tud szállítani az eladni kívánt árut. A <a href="HELP_ROOT?domen=1&id=34">teleport</a> leírásában látható, hogy egy TT-vel (töltéssel) mennyit bír átvinni az egyes erőforrásokból. A bolygó adatlapján felül az összefoglaló adatok közt láthatod, hogy mennyi a teleportjaid aktuális töltése és teljes kapacitása.<br />\r\nVételi ajánlat feladásakor az ajánlott pénz levonódik a vagyonodból. Ha később kedvezőbb áron teljesül az ajánlatod, akkor a különbözetet visszakapod. Eladási ajánlatnál pedig az eladásra szánt erőforrás vonódik le a készleteidből.<br />\r\nHa törölni akarsz egy korábbi ajánlatot, akkor kattints a T-re. Ekkor vételi esetén visszakapod a pénzed, eladási esetén pedig az árut.<br />\r\nHa pedig módosítanád egy eladási ajánlat árát, akkor kattints az M-re. Ez akkor lehet hasznos, ha időközben változott a piaci ár, és már nem vagy a legjobbak között (ez onnan látszik, h nem félkövéren van kiírva az ajánlat).</li>\r\n<li><b>készlet</b>: ez mutatja, hogy mennyi a teljes készleted az adott erőforrásból ezen a bolygón. Ha rákattintasz, beíródik a szám az új ajánlat küldő mezőbe.</li>\r\n</ul>\r\n<p>Mivel az eladási ajánlatokat a tőzsde raktározza, ennek költsége van. Az első 24 óra ingyenes, utána viszont óránként az ajánlat 1%-át elveszi a tőzsde, mint raktárköltség. Ennek célja, hogy ne raktárnak használd a tőzsdét, vagyis olyan áron tegyél ki eladási ajánlatot, hogy azt lehetőleg meg is vegyék.</p>\r\n<p>A Galaktikus Központi Bank kétféle módon avatkozik a kereskedelembe. Egyrészt a játék kezdetén, amikor még senkinek nincs teleportja, tehát nem tud eladni, fát és követ ad el, hogy aki nagyon megszorul, az tudjon venni. Másrészt a játék során folyamatosan vesz erőforrásokat, természetesen minden piacon a lehető legalacsonyabb áron. Ezért a termelt fölösleget, ha nem tudjuk építkezésre vagy egyébre használni, érdemes eladni a tőzsdén a Banknak (vagy másnak), hiszen ebből lesz pénzünk, amiből vásárolhatunk. Így biztosítja a Bank a növekvő termeléshez a növekvő pénzkínálatot, hogy elkerülje a deflációt (vagyis az árak folyamatos csökkenését).</p>', 'screenshot_tozsde_v2.png', 'Saját bolygó adatlapja#Tőzsde', '', 'Profile of your planet#Exchange'),
(0, 7, '<p>A szállítás oldalon tudsz erőforrásokat szállítani a bolygóid (illetve szövetségeseid bolygói) között. Feltéve, hogy van <a href="HELP_ROOT?domen=1&id=34">teleport</a>od a küldő bolygón. Ezen (és a tőzsde) oldalon láthatod, hogy mennyi a teleportjaid aktuális töltése és teljes kapacitása. A teleport leírásában látható, hogy egy TT-vel (töltéssel) mennyit bír átvinni az egyes erőforrásokból.</p>\r\n<p>A szállításhoz meg kell adnod, hogy az egyes erőforrásokból mennyit akarsz átküldeni. A max-ra kattintva beíródik a teljes készlet. A jelenlegi töltéssel szállítható oszlopban a számok azt mutatják, hogy ha csak abból az egy erőforrásból akarsz szállítani, akkor ennyit bírnak el jelenleg a teleportjaid. Nyilván, ha többfélét is szállítasz, akkor kevesebbet.</p>\r\n<p>Ha beírtad a számokat, kattints lent arra a zöld nyílra, amelyik a célzott bolygó mellett található. Ekkor elmegy az árú, a bolygón található teleportok töltése pedig lecsökken.</p>\r\n\r\n<p>Szövetséges bolygóra csak akkor tudsz szállítani, ha rendelkezel teleportjoggal. Szállítás esetén mind a küldő, mind a fogadó bolygó kezdővédelme leesik 24 órára. Ez vonatkozik az ütemezett szállításra (és az adózásra) is.</p>\r\n\r\n<h2>Ütemezett szállítás</h2>\r\n<p>Ez egy PRÉMIUM szolgáltatás, amivel beállíthatod, hogy körönként miből mennyi erőforrást akarsz átküldeni más (saját vagy szövetséges) bolygóra. Egyszerűen válaszd ki az erőforrás nevét, add meg a mennyiséget, és a célbolygó nevét, és kattints a "GO"-ra. Ezentúl minden termelési körben, az adózás után és a termelés előtt, ha van elég teleportkapacitásod, a megadott mennyiségű áru átkerül a megadott bolygóra. Ügyelj arra, hogy a célbolygón fel is használják ezt, különben betelnek a raktárak, és a fölösleg elveszik.</p>\r\n', 'screenshot_szallitas_v2.png', 'Saját bolygó adatlapja#Szállítás', '', 'Profile of your planet#Transfer'),
(0, 8, '<p>Fent látható a bolygó neve. Jobb oldalt nagyban egy kép, valahogy így néz ki a bolygó. A név alatt, a képtől balra pedig a legfontosabb adatok:</p>\r\n<ul>\r\n<li><b>Tulajdonos</b>: kié a bolygó. A névre kattintva feljön az adatlapja. Ha közös tulajdonban van, akkor a szövetség neve, és zárójelben a kezelőé. Ha nincs tulajdonosa, és azt írja, hogy "új regisztrációnál nem adható", akkor a túlzott sűrűség elkerülése végett az adott bolygót újonnan regisztrált ember nem kaphatja meg. Vagyis ha egy barátodat meghívod, akkor ne ennek a bolygónak a koordinátáit add meg.</li>\r\n<li><b>Pozíció</b>: a bolygó koordinátái. Ha rákattintasz, a térkép oda ugrik, ahol a bolygó található.</li>\r\n<li><b>Osztály</b>: a bolygó osztálya. Rákattintva rövid összefoglalót kapsz az adott bolygóosztályról.</li>\r\n<li><b>Terület</b>: a bolygó felszínének teljes területe. Minél nagyobb, annál nagyobb ökoszférát bír el.</li>\r\n<li><b>Hold</b>: van-e holdja a bolygónak. Az árapályerőművek miatt fontos.</li>\r\n<li><b>Támadható</b>: két esetben nem támadható egy bolygó. Ha újoncvédelem alatt áll, vagy ha támadási moratórium van. Előbbi akkor van, ha a bolygó tulajdonosának nincs több bolygója. Utóbbi pedig akkor fordul elő, ha nemrég támadta valaki a bolygót. Sikeres fosztogatás után egy óráig senki sem támadhatja az adott bolygót, hogy a tulajdonosnak legyen esélye felkészülni az újabb támadásokra.</li>\r\n<li><b>Kémeid száma (likvidált)</b>: hány ügynököd kémkedik ezen a bolygón (zárójelben, hogy legutóbb hányat likvidáltak az ellenséges elhárítók)</li>\r\n<li><b>Szabotőreid száma (likvidált)</b>: hány ügynököd folytat szabotőrtevékenységet ezen a bolygón (zárójelben, hogy legutóbb hányat likvidáltak az ellenséges elhárítók)</li>\r\n</ul>\r\n<p>Ha folytatsz kémtevékenységet az adott bolygó ellen, akkor alul láthatod az eddig bejött jelentéseket. Négy témakör van: statisztikák, űrhajózás, gyárak, erőforrások. Mindegyiken belül a jelentéseknél láthatod, hogy mikor készült (vagyis mennyire friss, megbízható az adat), milyen témában (a témakörön belül), és mi a tartalma.</p>', 'screenshot_bolygo_idegen.png', 'Idegen bolygó adatlapja', '', 'Profile of someone else''s planet'),
(0, 100, '<h2>Mi ez a játék?</h2>\r\n\r\n<p>Ez egy első osztályú mmo stratégia. Egy játék, amihez pusztán egy böngészőre van szükséged! :)</p>\r\n\r\n<h2>Hogyan regisztrálhatok rá?</h2>\r\n\r\n<p>Az <a href="http://s1.zandagort.hu/">s1.zandagort.hu</a> címen tudsz regisztrálni.</p>\r\n\r\n<h2>Regisztráltam. Mit tegyek elsőnek?</h2>\r\n\r\n<p>Az első dolgod, hogy fölfedezd a játék kezelőfelületét:</p>\r\n\r\n<ul>\r\n\r\n<li>Balra lent az első gomb a Birodalom. Itt tudsz megnézni egy rövid áttekintést a legfontosabb adatokról.</li>\r\n\r\n<li>A második a szövetség. Itt tudsz belépni egy szövetségbe vagy sajátot alapítani. Vigyázz arra hogy a szövetség nem átjáróház, nem fognak örülni, ha naponta cseréled.</li>\r\n\r\n<li>Térkép: itt láthatod a bolygóidat (kezdetben csak egyet) és a többieket.</li>\r\n\r\n<li>Felderítés: a játék későbbi szakaszában lehetőséged lesz kémkedni, szabotázs akciókat végrehajtani. Ezeket innen irányíthatod.</li>\r\n\r\n<li>Levelek: itt érheted el a többi játékost, és a rendszer is küld üzeneteket a fontosabb eseményekről.</li>\r\n\r\n<li>Profil: itt található néhány alap adatod, módosíthatod a jelszavadat, és itt van egy játékoskereső.</li>\r\n\r\n<li>Help: itt részletes leírást találsz a játékról.</li>\r\n\r\n<li>Logout: itt léphetsz ki a karakteredből.</li>\r\n\r\n<li>A menü fölött láthatsz két ablakot. Itt láthatod a bolygódat, és itt fognak megjelenni a flottáid. Klikkelj a bolygódra. Fölül egy áttekintést láthatsz a bolygódról. Klikkelj a bolygód képének bal fölső sarka mellett lévő kérdőjelre. Itt részletesen megtalálod melyik információ mit mutat\r\nmeg. Ez alatt öt fül van: ökoszféra, gazdaság, háború, tőzsde, szállítás. Itt tekintheted meg részleteseben a bolygódat.</li>\r\n\r\n</ul>\r\n\r\n<h2>Hogyan építkezhetek?</h2>\r\n\r\n<p>Ha építenél valamit, klikkelj a gazdaság fülre. Itt láthatod az épületeidet: Szélfarm, Húsüzem, Vegagyár, Falu. Építéshez klikkelj az új épület gombra, válassz a kategóriák közül (Erőművek, Élelmiszeripar, Kitermelés, Települések), és írd be hány db-ot szeretnél építeni. Két dolgot tehetsz: építesz, vagy inaktívat építesz. Az építéssel normálisan építed meg őket, az inaktívval, miután elkészültek az épületek, nem fognak termelni, de az erőforrásokat sem kezdik el elfogyasztani.</p>\r\n\r\n<p>Most hogy megismerted a játék kezelését, el is kezdhetsz játszani!</p>', '', 'Bevezetés/irányítás (Gyakorlott gamereknek kihagyható)', '', 'Intro (advanced gamers can skip it)'),
(0, 101, '<p>Két alapvető dologra kell figyelned a játék során: a növekedés és az egyensúly.</p>\r\n\r\n<p>Ahhoz, hogy növekedni tudj, építkezned kell, ehhez pedig építőanyagokra lesz szükséged. Az elején ez a fa és a kő, később majd bővülni fog a titánnal, üveggel, műanyaggal. Kezd azzal, hogy építesz <b>2 kőbányát és 2 fűrészmalmot.</b> A bolygód adatlapján a Gazdaság fül alatt találod az Új épület menüt. Innen tudod kiválasztani ezeket a Kitermelés nevű iparágból.</p>\r\n\r\n<p>A másik, amire ügyelned kell, az egyensúly:</p>\r\n<ul>\r\n<li>A gyárak működéséhez munkaerőre van szükség.</li>\r\n<li>A munkaerő a népesség fele.</li>\r\n<li>A népesség a lakóhelyek és az élelmiszer mennyiségétől függ.</li>\r\n<li>A lakóhelyek mennyisége a falvak és városok, az élelmiszer pedig a vegagyárak és húsüzemek számától függ.</li>\r\n</ul>\r\n<p>Mivel ezen gyárak és települések működtetéséhez is munkaerő kell, ezért körbeértünk. Akkor van egyensúlyban a rendszer, ha van elég munkaerő, amihez pedig van elég lakóhely és élelmiszer.</p>\r\n\r\n<p>Éppen ezért <b>építs 20 falvat</b>. Amint ezek megépülnek, növekedésnek indul a népesség, így ki tudják szolgálni a gazdaságodat.</p>\r\n\r\n<p>Még egy fontos dolog: az energia. Minden gyár használ energiát, éppen ezért szervezd meg jól az energiaellátásodat. Első körben <b>építs még 26 szélfarmot</b>.</p>\r\n\r\n<p>Amíg az építkezések folynak, fedezd fel a játék felületét, vagy olvass bele a tutorialba, amit a HELP menüben találsz. További segítséget a ? ikonokra kattintva találhatsz (mindig a megfelelő részről kapsz leírást), vagy kérdezz a fórumon.</p>\r\n\r\n<p>Miután elkezd termelni a kőbánya és a fűrészmalom, építhetsz újabb falvakat és egy vegagyárat, hogy gyorsabban nőjön a népesség. Ha eléri a 45 ezer főt, a következő szintre lépsz (lásd BIRODALOM menüpont, tech-szint).</p>', '', 'Mivel kezdjem a játékot? (Új játékosoknak ajánlott!)', '', ''),
(0, 102, '<ul>\r\n<li>Mindig ügyelj rá, hogy a kaja- és energiatermelésed, valamint a munkaerőhelyzeted rendben legyen, mert ezekre épül az egész gazdaság!</li>\r\n<li>Még mielőtt magasabb szintű gyárakat építenél, előbb az alacsonyabb szintűekből (fa/kő) kell biztos bázist kiépítened!</li>\r\n<li>A munkaerő a lakosság fele.</li>\r\n<li>Képzett munkaerőt csak a város ad, a falvak nem. Szükség viszont csak néhány high tech épületben (pl félvezetőgyár) lesz rájuk.</li>\r\n<li>Ha kipusztulnak az állatok, a génbankból rendelhetsz újakat.</li>\r\n<li>Érdemes az élelmiszeriparod elsősorban növényekre és gombára építeni, mert ezekből van nagyon sok, így nehéz őket kiírtani.</li>\r\n<li>Ha beadsz egy bolygót közösbe, afölött a szövetség rendelkezik. Ezért csak akkor tedd, ha megbízol bennük.</li>\r\n</ul>', '', 'Hasznos tippek kezdőknek! (Érdemes átolvasni, ha most játszol először!)', '', ''),
(0, 103, '<p>Hát ez a nap is eljött! A kis bolygód végre az iparosodás útjára lépett! Ám mielőtt belekezdesz, ellenőrizd még egyszer, hogy elegendő kőbánya és fűrészmalom áll a rendelkezésedre. (Mindkettőből 10-15 ajánlott!) Arra is figyelj, hogy elegendő munkásod és energiád legyen! Ha eddig takarékoskodtál, akkor még 10000 üveg áll a rendelkezésedre. Először is a szükséges nyersanyagokat kell beszerezned!</p>\r\n\r\n<ul>\r\n<li>Építs 1 Szénégetőt! Ez fából fog tiszta szenet előállítani, ami elengedhetetlen a titánkohászathoz.</li>\r\n\r\n<li>Építs 1 Titánművet! A titánmű építése rengeteg üveget és egyéb nyersanyagot igényel.</li>\r\n\r\n<li>Építs 1 Homokbányát! Később ebből a homokból fogod legyártani az első saját üveged!</li>\r\n\r\n<li>Építs 1 Üveggyárat!</li>\r\n</ul>\r\n\r\n<p>Ezzel meg is teremtetted az iparod alapjait. Azonban még nem pihenhetsz! Az űrhajózáshoz nélkülözhetetlen műanyagot és félvezetőket még nem tudod előállítani. De ezen anyagok előállítása igen költséges. Mielőtt belevágnál, előbb meg kell erősödnöd. Duplázd meg a titán és triplázd meg az üveg termelésed! Közben a fáról és kőröl se feledkezz meg!</p>\r\n\r\n<p>Most hogy megszilárdítottad a nehézipart, belekezdhetsz a bonyolultabb eljárásokba is. Szened már van. De elég? Gondoskodj legalább +400-as termelésről. Először is olajra és műanyagra lesz szükséged!</p>\r\n\r\n<ul>\r\n<li>Építs 1 Olajgyárat! Ez két műanyaggyárat tud ellátni.</li>\r\n<li>Építs 2 Műanyaggyárat!</li>\r\n</ul>\r\n\r\n<p>Ezután már nem nélkülözheted a képzett munkaerőt. A félvezetőgyártás már képzett szakembereket kíván! Őket azonban csak a városban találni, ahol vannak egyetemek. Ez igen költséges vállalkozás lesz. Hogy inkább befektetsz és növeled az iparod, vagy inkább kivárod, amíg összegyűlik a szükséges nyersanyag, az a te döntésed. Ha megvan, kezdheted is!</p>\r\n\r\n<p>Építs 1 Várost! Ez már nem egy kis szélfarm, több mint 1 napig tart az építése. Használd ezt az időt arra, hogy megerősödj.</p>\r\n\r\n<p>Most, hogy a városod elkészült, megvan az alapod, hogy belevágj életed legnagyobb kalandjába: az űrutazásba! Azonban előtte félvezetőre lesz szükséged.</p>\r\n\r\n<p>Építs Félvezetőgyárat! Te döntöd el, mennyibe szeretnél beruházni, de ne feledd, hogy homokra is szükségük van!</p>\r\n\r\n<p>Most válaszúthoz érkeztél, a játékban először, milyen stratégiát is kövess? Ha eddig még nem döntöttél, itt az ideje hogy megállj egy pillanatra, és átgondold a dolgokat.</p>\r\n\r\n<p>Építhetsz hajógyárat, és kirajzhatsz az űrbe, hogy új bolygókat kolonizálj, kifossz másokat, és hatalmas birodalmat alapíts. De ne feledd! Ez a legnagyobb sikerrel kecsegtető, de egyben legkockázatosabb döntés is!</p>\r\n\r\n<p>Építhetsz teleportokat, bekapcsolódhatsz az intergalaktikus kereskedelembe, hatalmas és tekintélyes kereskedővé válhatsz!</p>\r\n\r\n<p>Építhetsz kutatóintézeteket, és a tudomány és kultúra fellegvárává teheted bolygód!</p>\r\n\r\n<p>Nem kell csak az egyik utat választanod, több irányban is fejleszthetsz. De neked kell eldöntened, mibe mennyit fektetsz.</p>', '', 'Ipar (Érdemes elolvasni, mielőtt elkezdesz iparosodni!)', '', ''),
(0, 200, '<p>A fenti rajz a flották állapotgráfját ábrázolja, a körök az állapotok, a vonalak az átmenetek, a kék feliratok pedig a parancsok. Hogy világos legyen, mi is ez, jöjjön a magyarázat.</p>\r\n<p>Egy flotta alap esetben vagy állomásozik egy bolygó felett (ALLOMAS), vagy lebeg az űrben (ALL). Mindkét esetben, ha ellenséges (akinek a tulajdonosával hadban állsz) flotta közelít, azt megtámadja, de a helyét nem hagyja el (agresszív állapot, ezt jelzi a narancssárga kör). Bármit is csinál egy flotta, le lehet állítani (ÁLLJ parancs), ekkor lebegni fog az űrben (állomásoztatni azért nem lehet bárhol és bármikor, mert ahhoz kell egy bolygó is).</p>\r\n<p>A MENJ paranccsal a flottát elküldhetjük tetszőleges helyre, flottához vagy bolygóhoz. Amíg a cél felé halad (MEGY ...), a flotta csak visszalő az őt támadókra, de ő maga nem támad, hanem végrehajtja az utasítást (célkövető állapot, fekete kör). Ha odaér, megáll, illetve bolygó esetén állomásozni kezd a bolygó felett.</p>\r\n<p>A járőrözéssel védelmi vonalakat építhetünk ki: megadunk egy célpontot, és a flotta elindul oda (PATROL_1), majd ha odaért, visszafordul, és elindul a kiindulási pont felé (PATROL_2), majd ha odaért, kezdődik az egész előlről. Vagyis fel-alá "sétál" két pont között, és mivel ez agresszív állapot, a közelbe érő ellenséges flottákat megtámadja.</p>\r\n<p>Ha megtámadunk egy flottát, először odamegy a mienk (TAMAD FLOTTARA), és ha elég közel ér hozzá, megtámadja (TAMAD FLOTTAT). Ez egy célagresszív állapot (piros kör), ilyenkor csak a célpontot támadja a flottánk, mást nem (de persze bárkire visszalő). Ha a másik menekülni kezd, a mienk követi, amíg meg nem semmisíti (vagy ő maga meg nem semmisül, vagy vissza nem hívjuk, vagy le nem rázzák).</p>\r\n<p>És végül a "lényeg", a bolygók elleni támadás, fosztogatás, foglalás. Ha egy bolygót támadunk, az ott állomásozó flottákat támadjuk. Ezért akkor győzünk, ha őket legyőzzük (megsemmisülnek vagy elmenekülnek). Ekkor két eset lehetséges. Ha a bolygó lakosságának morálja magas, akkor a bolygót csak kifosztani tudjuk (a zsákmány a támadó flotta bázisbolygójára kerül), a lakosság morálja pedig csökken (20%-kal). Ezután egy támadási moratórium lép életbe, vagyis az adott bolygó ellen egy ideig nem indíthatunk támadást (más játékosok persze igen). Ez azért van, hogy a megtámadott félnek legyen esélye összeszednie magát. Ha letelik az idő, lehet újra támadni. Ez egész addig ismétlődik, amíg a morál nullára nem csökken, ekkor a lakosság fellázad, és átáll, vagyis a bolygót elfoglaltuk. Tehát nem csak az határozza meg egy bolygó védekező képességét, hogy milyen erős flották védik, hanem az is, hogy milyen a lakosság morálja.</p>\r\n<p>Ennek tükrében kétféle támadást indíthatunk. Ha tudjuk, hogy egy körben úgysem tudjuk elfoglalni a kiszemelt bolygót, és nem leszünk folyamatosan online, érdemes portyázni. Ekkor a flottánk odamegy (RAID BOLYGORA), legyőzi az ott állomásozó flottákat (RAID BOLYGOT), kifosztja a bolygót, és visszavonul (VISSZA), vagyis magától visszamegy a bázisbolygójára (ezt flottánként lehet kijelölni). Így nincs meg az a veszély, hogy a támadási moratórium alatt megtámadják a flottánkat. A másik lehetőség a sima támadás. Ekkor odamegy a flotta (TAMAD BOLYGORA), és addig támad és várakozik felváltva (TAMAD BOLYGOT), amíg el nem tudja foglalni.</p>', 'allapot_graf_1024.png', 'Flották és háború', '', '');
INSERT INTO `leirasok` (`domen`, `id`, `leiras`, `kep`, `cim`, `leiras_en`, `cim_en`) VALUES
(0, 201, '<h2>Kezdő flotta kisorsolása</h2>\r\n<p>Ha R[0 ; 2*támadó kezdeményezés] > R[0 ; védő kezdeményezés], akkor a támadó flotta kezd (vagyis azt tekintjük támadónak). Ha nem, akkor védő (vagyis azt tekintjük támadónak). R[x;y] egy x és y közötti egyenletes eloszlású véletlen szám. Vagyis minél nagyobb egy flotta kezdeményezése, annál valószínűbb, hogy előbb lő. És a támadó előnyt élvez.</p>\r\n\r\n<h2>A kisorsolt támadó flottában minden hajó lő egyet</h2>\r\n<p>A sebzéseket minden támadó típus - védő típus kombinációra külön számoljuk, és ezek összegződnek végül. Két típus közt a sebzés (HP-ban mérve):</p>\r\n<p>sebzés = min{támadó HP; 100000*gyök(támadó HP/100000)}/100 *<br />\r\ntűzerőmegosztás *<br />\r\n(korrekciós tényező * támadóerő * affinitás - védőerő)</p>\r\n<p>ahol</p>\r\n<ul>\r\n<li><b>min{támadó HP; 100000*gyök(támadó HP/100000)}/100</b>: Hány hajó támad <i>egyszerre</i> az adott típusból. Körönként típusonként egyszerre maximum 1000 hajó tud támadni. Ha ennél több van, azok több kör alatt tüzelnek. Így a nagyobb flották közti csaták tovább tartanak, mint a kisebbek közöttiek. És mivel körönként sorsolódik ki, hogy melyik flotta tüzel előbb, ezért a kezdeményezésnek fontos szerep jut.</li>\r\n<li><b>tűzerőmegosztás</b>: Milyen arányban osztják meg a támadó hajók a védő típusok közt a tűzerejüket.<br />\r\n      Arányos a védő típusok össz HP-jával (vagyis a darabszámával), a köztük lévő affinitással (inkább arra támad, ami ellen kiemelten jó), és a generációs különbséggel (vagyis mindegyik típus elsősorban a saját generációjába eső típusokra lő).</li>\r\n<li><b>korrekciós tényező</b>: R[min{pontosság+tapasztalat;100}/100 ; 1] * gyök(morál/100)<br />\r\n      Minél nagyobb a pontosság (ez a hajótípus függvénye) és a tapasztalat (ez a flotta előtörténetének a függvénye), annál biztosabban találnak célba a hajók. Ha elég magas, akkor a korrekciós tényező első fele mindig 100%, vagyis mindig telibe találnak a hajók.<br />\r\n      Minél kisebb a morál, annál kevésbé hajlandó harcolni a legénység. Ez a csökkenés először nem olyan jelentős (80%-os morálnál még csak 10%-os a csökkenés), 0%-nál viszont 0%-ra csökken, vagyis ekkor már annyira lázadoznak, hogy gyakorlatilag használhatatlan a flotta. Ha sikerül eljutni egy saját vagy szövetséges űrkikötőbe, ott helyreállítható a morál.</li>\r\n<li><b>támadóerő</b>: Az alap támadóerő (TE) és a növekmények (TE+) összege.<br />\r\n      pl egy skorpióra: 35<br />\r\n      tíz skorpióra: 35+1=36 (fejenként!)<br />\r\n      húsz skorpióra: 35+2=37 (fejenként!)<br />\r\n      harminc skorpióra: 35+3=38 (fejenként!)<br />\r\n      satöbbi, de legfeljebb az alap támadóerő 2-szeresére nőhet</li>\r\n<li><b>affinitás</b>: Alapból 1.<br />\r\n      Ha a kiválasztott támadótípus jó a védő ellen, akkor 2 (pl skorpió vs könnyűcirkáló).<br />\r\n      Ha pedig rossz, akkor 0,5 (pl skorpió vs fregatt).</li>\r\n<li><b>védőerő</b>: Az alap védőerő (VE) és a növekmények (VE+) összege.<br />\r\n      pl egy fulgurra: 50<br />\r\n      tíz fulgurra: 50+1=51<br />\r\n      húsz fulgurra: 50+2=52<br />\r\n      harminc fulgurra: 50+3=53<br />\r\n      satöbbi, de legfeljebb az alap védőerő 1,5-szeresére nőhet</li>\r\n</ul>\r\n<p>Ezután a kilőtt hajók függvényében újraszámolódnak a paraméterek (kezdeményezés, pontosság, sebesség...).</p>\r\n\r\n<h2>A kisorsolt védő flottában minden hajó lő egyet</h2>\r\n<p>Lásd a fent leírtakat.</p>\r\n\r\n<h2>A morál és tapasztalat frissül</h2>\r\n\r\n<p>Minden hajótípusnak van egy egyenértéke, ami az árazás alapja, vagyis ezzel arányos mennyiségű titánt, energia, munkaerő... egy hajó legyártása. Ezek a számok megtalálhatók a help-ben az űrhajók leírásainál. Csatában mindkét fél annyi tapasztalatot nyer, amennyit a másik félből sebez, pontosabban a sebzett egyenérték 1%-át. Vagyis egy könnyűcirkáló kilövéséért 0,01 TP jár.</p>\r\n\r\n<p>Míg a tapasztalatnál az ellenséges flottán ejtett sebzés számít csak, a morálnál az ellenséges és a saját sebzés (1%-ának) különbsége adja a változást. Amelyik flotta többet sebez a másikon, annak nő a morálja, a másiknak ugyanannyival csökken. Annyi korlátozással, hogy egy összecsapásban 50%-nál jobban nem változhat a morál.</p>\r\n', '', 'Hogy zajlik egy csata?', '<p>...</p>\r\n<p>damage = attacker''s HP/100 * sharing of firepower *<br />\r\n(correction factor * attack value * affinity - defense value)</p>\r\n<p>...</p>\r\n', 'The logic of battles'),
(0, 25, '<p>A térképen látható a <a href="HELP_ROOT?domen=-2&id=-1">Galaxis</a> egy kis része. Scrollozni az egérrel való huzogatással, és a térkép alatti nyilakkal lehet. Zoomolni a térkép alatti +/- gombokkal. A koordinátarendszer a Galaxis középpontjából indul, egy észak-déli és egy kelet-nyugati tengellyel. A használt mértékegység a parsec (pc).</p>\r\n<p>Ha egy bolygót vagy egy konkrét koordinátát keresel, írd be a térkép alatti mezőbe, nyomj entert, és a térkép oda ugrik.</p>\r\n<p>A jelölések: dőlt betűvel van egy bolygó neve (és koordinátája), ha védett, simán, ha nem.</p>\r\n<p>A színek:</p>\r\n<ul>\r\n<li><b style="color:rgb(255,255,255)">fehér</b>: "lakatlan", vagyis nincs tulajdonos</li>\r\n<li><b style="color:rgb(0,255,0)">zöld</b>: saját</li>\r\n<li><b style="color:rgb(100,160,255)">kék</b>: szövetséges</li>\r\n<li><b style="color:rgb(160,0,0)">sötét piros</b>: semleges tulajdonos</li>\r\n<li><b style="color:rgb(255,0,0)">világos piros</b>: háborúban állsz a tulajdonossal</li>\r\n<li><b style="color:rgb(255,160,0)">narancs</b>: békeszerződés van a tulajdonossal</li>\r\n<li><b style="color:rgb(255,255,0)">sárga</b>: MNT van a tulajdonossal</li>\r\n</ul>\r\n<p>A flották színezése ugyanilyen: <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_npc.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_sajat.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_szovi.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_semli.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_hadban.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_beke.gif"/ > <img src="HELP_IMG_ROOTimg/ikonok/flotta_ikon_16x16_mnt.gif"/ ></p>\r\n<p>Ha rákattintasz egy bolygóra vagy flottára, akkor kiválasztódik és bejön az adatlapja.</p>\r\n<p>Ha jobb klikkelsz egy saját flottára, akkor feljön egy menü, amiből kiválaszthatod, hogy milyen parancsot akarsz adni a flottának:</p>\r\n<ul>\r\n<li><b>Menj</b>: kattints a célterületre, és a flotta odamegy</li>\r\n<li><b>Járőrözz</b>: kattints a célterületre, és a flotta a jelenlegi pozíciója és a kijelölt hely között fog járőrözni</li>\r\n<li><b>Támadj</b>: kattints a célbolygóra vagy -flottára, és a flotta megtámadja</li>\r\n<li><b>Portyázz</b>: kattints a célbolygóra, és a flotta odamegy portyázni (vagy fosztogatás után visszatér a bázisára)</li>\r\n<li><b>Vissza</b>: a flotta visszavonul a bázisára (ezt a flotta adatlapján állíthatod be)</li>\r\n<li><b>Állj</b>: a flotta megáll</li>\r\n</ul>\r\n<p>Ha ki van jelölve egy flottád (kis villogó négyzet körülötte), és jobb klikkelsz egy bolygóra, akkor a következő parancsokat adhatod ki a flottádnak:</p>\r\n<ul>\r\n<li><b>Menj</b>: a flotta odamegy a bolygóhoz (és állomásozni kezd, ha saját vagy szövetséges)</li>\r\n<li><b>Járőrözz</b>: a flotta a jelenlegi pozíciója és a kijelölt bolygó között fog járőrözni</li>\r\n<li><b>Támadj</b>: a flotta megtámadja a bolygót</li>\r\n<li><b>Portyázz</b>: a flotta odamegy portyázni a bolygóhoz (vagy fosztogatás után visszatér a bázisára)</li>\r\n</ul>', 'screenshot_terkep.png', 'Térkép menüpont', '', 'Map menu'),
(0, 202, '<h2>0. szint (indulás)</h2>\r\n<ul>\r\n<li>Szélfarm</li>\r\n<li>Húsüzem</li>\r\n<li>Vegagyár</li>\r\n<li>Kenyérgyár</li>\r\n<li>Falu</li>\r\n<li>Fűrészmalom</li>\r\n<li>Kőbánya</li>\r\n\r\n</ul>\r\n\r\n<h2>1. szint (45 000 főtől)</h2>\r\n<ul>\r\n<li>Geotermikus erőmű (E-osztály)</li>\r\n<li>Bioetanol erőmű (A-, B-, C- és D-osztály)</li>\r\n</ul>\r\n\r\n<h2>2. szint (60 000 főtől)</h2>\r\n<ul>\r\n<li>Homokbánya</li>\r\n<li>Szénégető</li>\r\n\r\n</ul>\r\n\r\n<h2>3. szint (80 000 főtől)</h2>\r\n<ul>\r\n<li>Naperőmű (B-osztály)</li>\r\n<li>Hullámfarm (C-, D- és E-osztály)</li>\r\n<li>Árapályerőmű (C-, D- és E-osztály + hold)</li>\r\n<li>Ozmózis erőmű (D-osztály)</li>\r\n<li>Titánmű</li>\r\n<li>Üveggyár</li>\r\n<li>Olajgyár</li>\r\n</ul>\r\n\r\n<h2>4. szint (150 000 főtől)</h2>\r\n<ul>\r\n<li>Vízi erőmű (A- és D-osztály)</li>\r\n<li>HDR erőmű</li>\r\n<li>Urándúsító</li>\r\n<li>Műanyaggyár</li>\r\n<li>Város</li>\r\n\r\n</ul>\r\n\r\n<h2>5. szint (250 000 főtől)</h2>\r\n<ul>\r\n<li>Atomerőmű</li>\r\n<li>Szeszfőzde</li>\r\n<li>Félvezetőgyár</li>\r\n<li>Űrhajógyár</li>\r\n<li>Kutatóintézet</li>\r\n<li>Hírszerző központ</li>\r\n<li>Teleport</li>\r\n</ul>\r\n\r\n<h2>6. szint (500 000 főtől)</h2>\r\n<ul>\r\n<li>Fúziós reaktor</li>\r\n<li>SPS</li>\r\n<li>Űrkikötő</li>\r\n</ul>', '', 'Elérhető gyárak az egyes tech-szinteken', '<h2>Level 0 (beginning)</h2>\r\n<ul>\r\n<li>Wind farm</li>\r\n<li>Meat factory</li>\r\n<li>Veg factory</li>\r\n<li>Bakery</li>\r\n<li>Village</li>\r\n<li>Sawmill</li>\r\n<li>Quarry</li>\r\n\r\n</ul>\r\n\r\n<h2>Level 1 (from population 45 000)</h2>\r\n<ul>\r\n<li>Geothermal power plant (class E)</li>\r\n<li>Bioethanol power station (classes A, B, C and D)</li>\r\n</ul>\r\n\r\n<h2>Level 2 (from population 60 000)</h2>\r\n<ul>\r\n<li>Sand mine</li>\r\n<li>Coal factory</li>\r\n\r\n</ul>\r\n\r\n<h2>Level 3 (from population 80 000)</h2>\r\n<ul>\r\n<li>Solar power station (class B)</li>\r\n<li>Wave farm (classes C, D and E)</li>\r\n<li>Tidal power station (classes C, D and E + satellite)</li>\r\n<li>Osmotic plant (class D)</li>\r\n<li>Titaniumworks</li>\r\n<li>Glass factory</li>\r\n<li>Oil factory</li>\r\n</ul>\r\n\r\n<h2>Level 4 (from population 150 000)</h2>\r\n<ul>\r\n<li>Hydroelectric power station (classes A and D)</li>\r\n<li>HDR plant</li>\r\n<li>Enrichment plant</li>\r\n<li>Plastic factory</li>\r\n<li>City</li>\r\n\r\n</ul>\r\n\r\n<h2>Level 5 (from population 250 000)</h2>\r\n<ul>\r\n<li>Nuclear power plant</li>\r\n<li>Distillery</li>\r\n<li>Chip factory</li>\r\n<li>Spaceship factory</li>\r\n<li>Research institution</li>\r\n<li>Intelligence HQ</li>\r\n<li>Teleport</li>\r\n</ul>\r\n\r\n<h2>Level 6 (from population 500 000)</h2>\r\n<ul>\r\n<li>Fusion power plant</li>\r\n<li>SPS</li>\r\n<li>Space station</li>\r\n</ul>', 'Available factories on different tech levels'),
(2, 151, 'Az űrhajózási technika fejlesztésével érheted el a magasabb szintű hajókat.', '', 'Űrhajózás (kutatási téma)', '', 'Space technology'),
(2, 152, 'A plazmatechnológia a fejlettebb vadászgépek (Vadász, Raptor), rombolók (Romboló) és az Anyahajó fegyverzetéhez (plazmavető, plazmatorpedó) szükséges.', '', 'Plazmatechnológia (kutatási téma)', '', 'Plasma technology'),
(2, 153, 'A Nemesisek szinte átüthetetlen páncélzata nanohálóból készül, amely komoly fejlesztéseket igényel.', '', 'Nanotechnológia (kutatási téma)', '', 'Nanotechnology'),
(2, 154, 'A Szondák és OHS-ek speciális pajzsait előbb ki kell fejleszteni.', '', 'Pajzsok (kutatási téma)', '', 'Shield technology'),
(2, 155, 'Az SPS és a fúziós reaktor az energiatermelés csúcsát jelentik. Ezek eléréséhez energetikai kutatásokat kell folytatni.', '', 'Energetika (kutatási téma)', '', 'Energy technology'),
(0, 9, '<p>Fent látható a flottád neve. Tőle balra két nyíl, ezekkel tudsz végigfutni gyorsan a flottáidon. A kulcs ikonra kattintva átnevezheted. A csoport ikonnal pedig közösbe lehet adni, ha tagja vagy szövetségnek. Ha állomásozol egy saját vagy szövi bolygó felett, akkor a bolygó ikonnal tudod landoltatni a flottát. Ekkor a hajók elveszítik a legénységüket, és ha újra fellövöd őket, akkor újat kapnak 100%-os morállal. Éppen ezért, hogy ne lehessen így felnövelni könnyedén a morált, ha a visszahívott flotta morálja nem 100%-os, akkor a hajók egy része elveszik. Erről a visszahívásnál kapsz értesítést.</p>\r\n<p>A név alatt a legfontosabb adatok:</p>\r\n<ul>\r\n<li><b>Tulajdonos</b>: kié a flotta. A névre kattintva feljön az adatlapja. Ha közös tulajdonban van, akkor a szövetség neve, és zárójelben a kezelőé.</li>\r\n<li><b>Pozíció</b>: a flotta koordinátái. Ha rákattintasz, a térkép oda ugrik, ahol a flotta található.</li>\r\n<li><b>Bázis</b>: a flotta bázisbolygója. Ha a flotta fosztogat, a zsákmány erre a bolygóra kerül. Portyázás után és visszavonulás esetén pedig ide tér vissza állomásozni. A "Visszavonulás!"-ra kattintva kiadod a parancsot, vagyis a flotta megkezdi a visszavonulást a bázisra. A fekete szövegmezőbe egy bolygód nevét írhatod, és Enter-t nyomva vagy a zöld nyílra kattintva átállítódik a bázis erre.</li>\r\n<li><b>Tevékenység</b>: mit csinál épp a flotta? Ennek részleteit lásd <a href="HELP_ROOT?domen=0&id=200">ITT</a>. Ha csinál valamit, zárójelben megjelenik az "Állj!" felirat, erre kattintva le lehet állítani a flottát.</li>\r\n<li><b>Parancs</b>: a térképen kívül itt lehet parancsokat adni a flottának. Írd be a célbolygó nevét vagy a célkoordinátát, majd kattints a megfelelő parancsra. A flotta odamegy, vagy elkezd járőrözni a jelenlegi pozíciója és a célpont közt, vagy megtámadja a célt, vagy portyázni megy oda.</li>\r\n<li><b>Távolság</b>: ha van célpontja a flottának, ilyen távol van tőle.</li>\r\n<li><b>Hátralévő idő</b>: ha van célpontja a flottának, ennyi idő alatt ér oda.</li>\r\n<li><b>Morál</b>: a flotta morálja. Minden új hajónak, ami kikerül a gyárból, 100% a morálja. Ha egy flotta állomásozik, akkor nem változik vagy nő a morálja (utóbbihoz űrállomás kell). Ha pedig csatázik, akkor attól függően nő, vagy csökken, hogy győz vagy veszít. Részletesebben lásd <a href="HELP_ROOT?domen=0&id=201">ITT</a>.</li>\r\n<li><b>Összerő</b>: a flotta teljes ereje HP-ban. Egy hajó 100 HP, ha sérült, akkor arányosan kevesebb. Ez a szám a flottában lévő hajók HP-jának összege.</li>\r\n<li><b>Összérték</b>: a flotta teljes egyenértéke. Minden hajónak van egy saját egyenértéke, ami az adatlapján és a csataszimulátorban megtalálható. Az egyenérték a típus képességeitől függ, és az ára is ezzel arányos. Ha egy hajó sérült, akkor az egyenértéke a HP-jával van súlyozva. Ez a szám a flottában lévő hajók egyenértékének összege.</li>\r\n<li><b>Tapasztalat</b>: a flotta tapasztalata. Ha egy hajó csatában vesz részt, akkor nő a tapasztalata. Minél nagyobb az összecsapás saját magához képest, annál nagyobb mértékben. Részletesebben lásd <a href="HELP_ROOT?domen=0&id=201">ITT</a>.</li>\r\n<li><b>Kezdeményezés</b>: a flotta kezdeményező képessége. A benne található hajók kezdeményezésétől függ. Minél nagyobb, annál valószínűbb, hogy összecsapáskor előbb fog lőni, mint az ellenség. Részletesebben lásd <a href="HELP_ROOT?domen=0&id=201">ITT</a>.</li>\r\n<li><b>Sebesség</b>: a flotta sebessége. A flottában található hajók közül a leglassabbnak a sebessége. Éppen ezért, ha gyors küldetésre mész, érdemes lehet a lassú hajókat kidobálni.</li>\r\n<li><b>Látótávolság</b>: a flotta látótávolsága. A flottában található hajók közül a legmesszebbre látónak a látótávolsága. Az ellenséges flottákat ilyen messziről veszed észre, kivéve ha van rejtőzésük, mert az levonódik ebből a távolságból. Ha a különbözet felénél közelebb jön az ellenség, akkor a flotta összetételét is látod.</li>\r\n<li><b>Rejtőzés</b>: a flotta rejtőzése.  A flottában található hajók közül a legláthatóbbnak a rejtőzése. Ez a szám levonódik az ellenséges flották és bolygók látótávolságából.</li>\r\n</ul>\r\n<p>Ezután következik a flotta összetétele. Soronként egy hajótípus:</p>\r\n<ul>\r\n<li>Először egy ikon. Erre kattintva elolvashatod az adott típusra vonatkozó helpet.</li>\r\n<li>Utána a hajók száma HP-ben, majd darabszámban. Előbbi utóbbinak a 100-szorosa, mivel minden hajó 100 HP, minusz a sérülések.</li>\r\n<li>A fekete négyzetekbe darabszámokat lehet írni. Utána a lenti zöld nyilakkal lehet a kijelölt hajókat átpakolni más flottákba. A (max)-ra kattintva beíródik a maximális szám (ahány hajó van az adott típusból). A (mindet)-re kattintva pedig a teljes flotta. Utóbbi akkor hasznos, ha be akarod olvasztani egy másik, közelben lévő flottába.</li>\r\n<li>Végül az egyenérték az adott típusú hajók összes egyenértéke.</li>\r\n</ul>\r\n<p>Legalul láthatók a közelben lévő barátságos flották (zöld ikonnal a saját, kékkel a szövetséges). Ezekbe lehet a zöld nyilakkal átpakolni hajókat. Ha új flottát akarsz létrehozni, írd be a nevét a fekete mezőbe, és kattint a mellette lévő zöld nyílra.</p>', 'screenshot_flotta_sajat.png', 'Saját flotta adatlapja', '', 'Profile of your fleet'),
(0, 10, '<p>Fent látható a flotta neve. A név alatt a legfontosabb adatok:</p>\r\n<ul>\r\n<li><b>Tulajdonos</b>: kié a flotta. A névre kattintva feljön az adatlapja. Ha közös tulajdonban van, akkor a szövetség neve, és zárójelben a kezelőé.</li>\r\n<li><b>Pozíció</b>: a flotta koordinátái. Ha rákattintasz, a térkép oda ugrik, ahol a flotta található.</li>\r\n</ul>\r\n<p>Ha a flotta közelebb van, mint a te látótávolságod minusz az ő rejtőzésének a fele, akkor további részleteket is láthatsz:</p>\r\n<ul>\r\n<li><b>Összerő</b>: a flotta teljes ereje HP-ban. Egy hajó 100 HP, ha sérült, akkor arányosan kevesebb. Ez a szám a flottában lévő hajók HP-jának összege.</li>\r\n<li><b>Összérték</b>: a flotta teljes egyenértéke. Minden hajónak van egy saját egyenértéke, ami az adatlapján és a csataszimulátorban megtalálható. Az egyenérték a típus képességeitől függ, és az ára is ezzel arányos. Ha egy hajó sérült, akkor az egyenértéke a HP-jával van súlyozva. Ez a szám a flottában lévő hajók egyenértékének összege.</li>\r\n<li><b>Kezdeményezés</b>: a flotta kezdeményező képessége. A benne található hajók kezdeményezésétől függ. Minél nagyobb, annál valószínűbb, hogy összecsapáskor előbb fog lőni, mint az ellenség. Részletesebben lásd <a href="HELP_ROOT?domen=0&id=201">ITT</a>.</li>\r\n<li><b>Sebesség</b>: a flotta sebessége. A flottában található hajók közül a leglassabbnak a sebessége. Éppen ezért, ha gyors küldetésre mész, érdemes lehet a lassú hajókat kidobálni.</li>\r\n<li><b>Látótávolság</b>: a flotta látótávolsága. A flottában található hajók közül a legmesszebbre látónak a látótávolsága. Az ellenséges flottákat ilyen messziről veszed észre, kivéve ha van rejtőzésük, mert az levonódik ebből a távolságból. Ha a különbözet felénél közelebb jön az ellenség, akkor a flotta összetételét is látod.</li>\r\n<li><b>Rejtőzés</b>: a flotta rejtőzése.  A flottában található hajók közül a legláthatóbbnak a rejtőzése. Ez a szám levonódik az ellenséges flották és bolygók látótávolságából.</li>\r\n</ul>\r\n<p>Ezután következik a flotta összetétele. Soronként egy hajótípus:</p>\r\n<ul>\r\n<li>Először egy ikon. Erre kattintva elolvashatod az adott típusra vonatkozó helpet.</li>\r\n<li>Utána a hajók száma HP-ben, majd darabszámban. Előbbi utóbbinak a 100-szorosa, mivel minden hajó 100 HP, minusz a sérülések.</li>\r\n<li>Végül az egyenérték az adott típusú hajók összes egyenértéke.</li>\r\n</ul>', 'screenshot_flotta_idegen.png', 'Idegen flotta adatlapja', '', 'Profile of someone else''s fleet'),
(0, 11, '<p>Fent láthatsz összefoglaló adatokat a teljes birodalmadról:</p>\r\n<ul>\r\n<li><b>Pontszámod</b>: hány pontod van. A képlet: népesség + 10 000 x bruttó termelés TT-ben (csak a szállítható javakra) + 25 x flották egyenértéke. Óránként frissül.</li>\r\n<li><b>Helyezésed</b>: a pontszámod alapján hanyadik vagy a toplistán.</li>\r\n<li><b>Vagyonod</b>: mennyi pénzed van, amivel kereskedhetsz. A pénz egyetlen forrása, ha eladsz erőforrásokat a tőzsdén. És az egyetlen felhasználási helye szintén a tőzsde, ha veszel valamit.</li>\r\n<li><b>Bolygóid száma</b>: hány bolygód van. Ide értve a nálad kezelésben lévő közös bolygókat is.</li>\r\n<li><b>Bolygólimit</b>: legfeljebb annyi bolygód lehet, mint 1+2*gyök(össznépesség/1 millió). Ha lecsökken a népességed, és emiatt a limit fölé kerülsz, akkor nem vesznek el a bolygóid, de újat nem szerezhetsz. Ahhoz tehát, hogy hódíts, nem elég bolygókat fosztogatni és foglalni, megfelelő gazdaságot is fel kell húznod. Zárójelben fel van tüntetve a következő népességszint, ahol eggyel nő a limit.</li>\r\n<li><b>Bolygóid össznépessége</b>: hány ember él összesen a bolygóidon</li>\r\n<li><b>Flottáid száma</b>: hány flottád van. Ide értve a nálad kezelésben lévő közös flottákat is.</li>\r\n<li><b>Flottalimit</b>: legfeljebb annyi flottád lehet, mint a bolygólimit 3-szorosa.</li>\r\n<li><b>Flottáid össz HP-ja</b>: a flottáid HP-jának összege</li>\r\n<li><b>Flottáid összértéke</b>: a flottáid egyenértékeinek összege</li>\r\n</ul>\r\n<p>Ezután jönnek a bolygóid felsorolva. Mindegyiknél jelezve azt is, ha a bolygó szövetségi tulajdon, de te kezeled.</p>\r\n<p>Ezután láthatod, hogy milyen tech-szinten vagy. Ez a népességtől függ. Nullán kezded, és egészen 6-ig mehetsz föl. Minden szint újabb gyárak építését teszi lehetővé. Így fokozatosan ismerkedhetsz meg a játék lehetőségeivel, és kevesebb hibára van esélyed. Részletesebben lásd <a href="HELP_ROOT?domen=0&id=202">ITT</a> és <a href="HELP_ROOT?domen=0&id=-1">ITT</a>.</p>\r\n<p>Ez alatt láthatod felsorolve, hogy az adott tech-szinten milyen új (a korábbi tech-szinten még nem elérhető) gyárakat tudsz építeni. Az ikonokra kattintva eléred az odavágó helpet.</p>\r\n<p>Utána jön a következő szinthez szükséges népesség, majd az akkortól elérhető gyárak.</p>\r\n<p>Ezután láthatod a K+F (kutatás+fejlesztés) terén elért eredményeidet. Ha <a href="HELP_ROOT?domen=1&id=31">kutatóintézet</a>eket építesz, bármelyik témában tudod növelni a kutatási pontjaidat (KP), amivel magasabb szintű erőműveket és űrhajókat érhetsz el. Az egyes témákról leírást a help-ben találsz: kattints a témák címére.</p>\r\n<p>Végül legalul található a K+F megosztás. Add meg a kedvezményezett nevét (akinek át akarsz adni tudást), a témát, és hogy hány pontot akarsz átadni (legfeljebb a pontjaid felét oszthatod meg). Ezek után, ha az illetőnek kevesebb pontja volt, mint amennyit átadtál, akkor felhúztad erre a szintre. Ha több, akkor nem tudsz neki segíteni. Tehát ha pl űrhajózásban neki 500 pontja van, neked 2000, ekkor te legfeljebb 1000 KP-ra tudod őt felhúzni. Ha már eleve több, mint 1000 pontja volt, akkor túl fejlett, vagyis te csak akkor tudnál rajta segíteni, ha legalább 2-szer annyi pontod lenne, mint neki.</p>', 'screenshot_birodalom.png', 'Birodalom menüpont', '', 'Empire menu'),
(0, 12, '<p>Új szövetséget akkor alapíthatsz, ha nem vagy még tagja egynek sem (ha tag vagy, előbb lépj ki). Amit kötelező megadnod:</p>\r\n<ul>\r\n<li><b>Név</b>: a szövetség neve. Nem lehet azonos létező szövetség vagy játékos nevével.</li>\r\n<li><b>Alapító megnevezése</b>: mi legyen a megnevezésed (nem a neved, mert az már adott), mint alapítónak. Pl Király, Caesar, Elnök, Lord, Főtitkár, Alapító...</li>\r\n</ul>\r\n<p>És amit nem:</p>\r\n<ul>\r\n<li><b>Mottó</b>: a szövetség rövid mottója. Ez megjelenik szinte az összes listában, ahol a szövetség szerepel.</li>\r\n<li><b>Üdvözlet (külsősöknek)</b>: ezt bárki láthatja, aki megnézi a szövetség adatlapját.</li>\r\n<li><b>Szabályzat (tagoknak)</b>: ezt csak a tagok láthatják. Illetve ha meghívót küldesz valakinek, akkor a meghívó mellé csatolhatod a szabályzatot. Ezt csak akkor tedd, ha nem titkos, hiszen így kiszivároghat.</li>\r\n</ul>', 'screenshot_szov_uj_szov.png', 'Szövetség menüpont', '', 'Alliance menu'),
(0, 13, '<p>Ha még nem vagy tagja szövetségnek, a SZÖVETSÉG menüpontban láthatod a meghívóidat. Sorban, hogy ki hívott meg, melyik szövetségbe, mikor, és két ikon. A zöld pipával elfogadhatod a meghívót. Ekkor a szövetség tagjává válsz. A piros iksszel pedig elutasíthatod, ekkor nem.</p>\r\n<p>Szövetségbe csak úgy kerülhetsz be, ha meghívnak. Ha megtetszik egy szövetség, írj az alapítójának, vagy akit a szövetség adatlapján megjelölnek, hogy küldjön meghívót.</p>', 'screenshot_szov_meghivo.png', 'Szövetség menüpont#Meghívások', '', 'Alliance menu#Invitations'),
(0, 14, '<p>Felül láthatod a szövetség nevét. Mellette, ha te vagy az alapító, egy szerk linket, amivel szerkeszteni tudod a szövetség alap adatait.</p>\r\n<p>PRÉMIUM szolgáltatás. Ha te vagy a szövetség alapítója, akkor a szövetség szerkesztésénél tudsz minicímer és címert/zászlót feltölteni. Előbbi a játékos avatárhoz hasonlít, max 32x32-es kis ikon, ami a szövetség neve mellett jelenik meg. Utóbbi pedig egy nagy (max 320x320-as) címer vagy zászló, ami a szövetség adatlapján lesz látható. Ahhoz, hogy egy szövetségnek címere lehessen, legalább az egyik tagjának elő kell fizetnie a prémiumra (kivéve persze az ingyen időszakban).</p>\r\n<p>Alatta a következők:</p>\r\n<ul>\r\n<li><b>...</b>: a szövetség alapítójának megnevezése és személye</li>\r\n<li><b>Alapítva</b>: hány napja jött létre a szövetség</li>\r\n<li><b>Mottó</b>: a szövetség mottója</li>\r\n<li><b>Taglétszám</b>: hány tagja van a szövetségnek</li>\r\n<li><b>Tisztséged</b>: mi a tisztséged a szövetségen belül</li>\r\n<li><b>Üdvözlet (külsősöknek)</b>: bárki által látható üdvözlet</li>\r\n<li><b>Szabályzat (tagoknak)</b>: csak a tagoknak szóló szabályzat</li>\r\n</ul>\r\n<p>Alatta egy menü látható, amivel a szövetség aloldalait érheted el:</p>\r\n<ul>\r\n<li><a href="HELP_ROOT?domen=0&id=15">Fórum</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=17">Diplomácia</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=18">Közös</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=19">Tagok</a></li>\r\n<li><a href="HELP_ROOT?domen=0&id=20">Tisztségek</a></li>\r\n</ul>', 'screenshot_szov_sajat.png', 'Saját szövetség adatlapja', '', 'Profile of your alliance'),
(0, 15, '<p>A szövetségi fórumot csak a szövetség tagjai olvashatják, és persze csak ők írhatnak bele. A fórum témákra bomlik, minden téma egy beszélgetésnek felel meg.</p>\r\n<p>A nyitó oldalon a témák listáját láthatod, az utolsó hozzászólás szerint rendezve. Ha rákattintasz valamelyik címére, megjelennek az oda írt <a href="HELP_ROOT?domen=0&id=16">kommentek</a>. A téma szerzője az, aki a témát indította. A kommentek száma és az utolsó hozzászólás pedig egyértelmű, hogy mit jelent.</p>\r\n<p>Ha új témát akarsz indítani, kattints az "új témá"-ra, add meg a téma címét, és a nyitó kommentet. Ehhez "új téma" joggal kell rendelkezned, ami azon múlik, hogy milyen tisztséged van, és a tisztségednek milyen jogai.</p>\r\n<p>Ha egy témában született komment azóta, hogy te utoljára láttad, akkor egy piros felkiáltójel jelenik meg a téma címe mellett. Ez jelzi, hogy olvasatlan.</p>\r\n<p>A Témák felirat mellett néha látható ugyanez az ikon, egy számmal mellette. Ez jelzi az olvasatlan témák számát.</p>\r\n<p>Balra lent, a szövetség gombon időnként feltűnik egy piros szám. Ez szintén az olvasatlan témák számát jelenti.</p>\r\n<p>Ha van moderációs jogod, akkor mindegyik téma mellett megjelenik egy piros X. Erre kattintva törölheted az adott témát (a benne lévő összes kommenttel együtt).</p>', 'screenshot_szov_forum.png', 'Saját szövetség adatlapja#Fórum', '', 'Profile of your alliance#Forum'),
(0, 16, '<p>Egy témán belül a hozzászólásokat láthatod itt, az utolsóval a legelején. Ha új kommentet akarsz írni, kattints az "Új komment..."-re, és írd meg. Ha vissza akarsz térni a <a href="HELP_ROOT?domen=0&id=15">témák listájához</a>, kattints a "Témák" feliratra.</p>\r\n<p>Ha van moderációs jogod, akkor mindegyik komment mellett megjelenik egy piros X. Erre kattintva törölheted az adott kommentet.</p>', 'screenshot_szov_forum_kommentek.png', 'Szövetség/Szövetségi fórum (kommentek)', '', 'Alliance/Forum (comments)'),
(0, 17, '<p>Ha nem vagy tagja szövetségnek, ugyanezeket az opciókat érheted el a SZÖVETSÉG menüpontból, csak ilyenkor nem a szövetséged köt szerződéseket, hanem te magad.</p>\r\n<p>Legfelül láthatók a státuszok. Minden szövetség illetve magányos játékos között 4-féle státusz lehetséges:</p>\r\n<ul>\r\n<li><b style="color:rgb(160,0,0)">Semlegesség</b>: Induláskor ez van minden fél között, ezért nincs jelezve külön sehol. Ha a két fél flottái összetalálkoznak, békén hagyják egymást, így nyugodtan repkedhetnek egymás területén és csatázni is tudnak közös ellenség ellen. Szabadon lehet egymást támadni, fosztogatni, foglalni.</li>\r\n<li><b style="color:rgb(255,0,0)">Háború</b>: Hadüzenet (egyoldalú) küldésével lehet háborúba lépni valakivel, és tűzszünet (kétoldalú) kötésével lehet visszatérni a semleges állapotba. A legfőbb eltérés a semlegességhez képest az, hogy a flották automatikusan egymásra lőnek, ha találkoznak (kivéve, ha mindkettő siet a dolgára, lásd <a href="HELP_ROOT?domen=0&id=200">ITT</a>). Viszont ugyanúgy bármit lehet csinálni.</li>\r\n<li><b style="color:rgb(255,160,0)">Béke</b>: Ha a két fél békeszerződést köt, akkor majdnem ugyanaz a helyzet, mint semlegesség esetén, leszámítva, hogy ha bármelyik oldalon bárki megszegi a szerződést a másik fél elleni támadással, fosztogatással vagy foglalással, arról mindkét oldalon értesülnek a diplomaták (vagyis a szövetségek alapítói és diplomáciai joggal rendelkező tagjai). Maga a szerződés ettől nem szűnik meg, azt valamelyik félnek explicite fel kell bontania.</li>\r\n<li><b style="color:rgb(255,255,0)">Meg nem támadás (MNT)</b>: Ha a két fél megnemtámadási egyezményt köt, akkor a flottáik maguktól nem támadják meg egymást, viszont nincs is lehetőség aggresszióra. Vagyis amíg az egyezmény érvényben van, addig se támadni, se fosztogatni, se foglalni nem lehet. Az egyezmény egyoldalúan felbontható.</li>\r\n</ul>\r\n<p>A státuszok táblázatban sorban látható, hogy milyen státusz van kivel, mióta, ki kezdeményezte, és milyen esetleges megjegyzést fűzött hozzá (pl békeszerződés részletei). Utóbbira rákattintva elolvasható a hosszabb verzió, ha van.</p>\r\n<p>Ezután jönnek a státuszváltások. Itt lehet hadat üzenni (ekkor Háborúra változik a státusz), és békeszerződést vagy MNT-t felbontani (ekkor Semlegességre). A megjegyzést levélben kapja meg a másik fél (szövetség esetén az alapító és a diplomaták).</p>\r\n<p>És végül, az új ajánlat küldése. Itt lehet tűzszünetet, békeszerződést vagy MNT-t kezdeményezni. Ha az ajánlatot elfogadják, akkor a státuszváltás (semlegesre, békére, MNT-re) bekövetkezik. Ha elutasítják, akkor nem.</p>', 'screenshot_szov_diplo.png', 'Saját szövetség adatlapja#Diplomácia', '', 'Profile of your alliance#Diplomacy'),
(0, 18, '<p>Itt látható a szövetség közös bolygói és flottái. Ezek a szövetség tulajdonában vannak, vagyis a szövetség alapítója és közös tulajdon jogot kapott tisztek rendelkeznek felette. Minden közös bolygónak és flottának van egy kezelője, aki ténylegesen irányítja.</p>\r\n<p>Ha közös bolygót vagy flottát akarsz átadni más kezelőnek (és van ilyen jogosultságod), akkor írd be a nevét alulra a fekete mezőbe, és kattints a kiválasztott bolygó/flotta sorában lévő zöld nyílra. Bolygó esetén a kijelölt kezelőnek előbb el kell fogadni a megbízást, utána kerül csak hozzá a bolygó. Ez azért van így, mert a kezelésbe kapott bolygóval <a href="HELP_ROOT?domen=0&id=104">elveszti a teljes védelmét</a>, ha eddig csak egy bolygója volt.</p>\r\n<p>Ha az aktuális kezelőnek akarod átadni magánkézbe, akkor kattints az ember ikonra. Vigyázz, ez esetben a bolygó/flotta megszűnik közös tulajdon lenni, vagyis onnantól nem a szövetség rendelkezik felette.</p>', 'screenshot_szov_kozos.png', 'Szövetség/Közös bolygók és flották', '', 'Alliance/Joint planets and fleets'),
(0, 19, '<p>Itt láthatod a szövetség tagjait, tisztség és név szerint rendezve. Az adómorál azt jelzi, hogy hány alkalomból hányszor fizette be 100%-osan az adóját. Ha ez problémás, annak több oka is lehet: vagy szándékosan nem hagy elég készletet illetve teleportkapacitást az adónak, vagy épp kifosztották, vagy nincs még (elég) teleportja. Az adózásról részletesen a <a href="HELP_ROOT?domen=0&id=20">Tisztségek</a>nél olvashatsz.</p>\r\n<p>Ha van kinevezési jogod, itt nevezhetsz ki bárkit. Ebbe beletartozik a lefokozás is.</p>\r\n<p>Ha van kirúgási jogod, itt rúghatsz ki tagot.</p>\r\n<p>Ha van meghívási jogod, itt hívhatsz meg új tagot. Ha az illető a meghívót elfogadja, tagja lesz a szövetségnek.</p>\r\n<p>Itt léphetsz ki a szövetségből. Ha te vagy az alapító, meg kell nevezned az utódodat. Ha te vagy utolsó tag, kilépéseddel a szövetség is megszűnik.</p>', 'screenshot_szov_tagok.png', 'Saját szövetség adatlapja#Tagok', '', 'Profile of your alliance#Members'),
(0, 20, '<p>Itt láthatod az egyes tisztségek jogosultságait és adózását. Az alapító az összes joggal rendelkezik, plusz ő állíthatja be a jogosultságokat. A mezei tagok egyik joggal sem rendelkeznek.</p>\r\n<p>Ha te vagy alapító, a szerk-re kattintva beállíthatod a már létező tisztségek jogosultságait a megfelelő négyzeket beikszelésével. A piros ikszekkel törölhetsz meglévő tisztségeket (ekkor az ide tartozó tagok mezei tagokká válnak). Az ÚJ sorban pedig új tisztséget hozhatsz létre.</p>\r\n<p>A jogok:</p>\r\n<ul>\r\n<li><b>adózás</b>: aki ezzel rendelkezik, az beállíthatja, hogy ki, kinek, miből mennyit adózzon (függetlenül attól, hogy ő maga adózik-e, vagy neki adóznak-e), részletesen lásd <a href="HELP_ROOT?domen=0&id=105">ITT</a></li>\r\n<li><b>meghívás</b>: aki ezzel rendelkezik, az meghívhat új tagokat</li>\r\n<li><b>kirúgás</b>: aki ezzel rendelkezik, az az alapítón kívül <i>bárkit</i> kirúghat (a nála több joggal rendelkezőket is)</li>\r\n<li><b>kinevezés</b>: aki ezzel rendelkezik, az bárkit bármilyen tisztségre kinevezhet/lefokozhat</li>\r\n<li><b>közös bolygók</b>: aki ezzel rendelkezik, az eldöntheti, hogy ki kezelje a közös bolygókat</li>\r\n<li><b>közös flották</b>: aki ezzel rendelkezik, az eldöntheti, hogy ki kezelje a közös flottákat</li>\r\n<li><b>diplomácia</b>: aki ezzel rendelkezik, az hadat üzenhet, békét vagy MNT-t köthet, és értesítést kap, ha bárki megszegi a békeszerződést</li>\r\n<li><b>új téma</b>: aki ezzel rendelkezik, az nyithat új témát a szövetségi fórumban</li>\r\n<li><b>moderáció</b>: aki ezzel rendelkezik, az törölhet kommenteket és teljes témákat is a szövetségi fórumban</li>\r\n<li><b>radar</b>: aki ezzel rendelkezik, az látja a szövitársai bolygói és flottái által látott flottákat (így nem kell mindenkinek saját szondákat küldeni, meg lehet osztani egymással az információkat)</li>\r\n<li><b>privatizálás</b>: aki ezzel rendelkezik, az átadhatja magánkézbe (az aktuális kezelőnek) a közös bolygókat és flottákat (ezzel könnyű visszaélni, úgyhogy csak óvatosan)</li>\r\n<li><b>teleport</b>: aki ezzel rendelkezik, az szállíthat a szövitársainak árut, aki nem, az csak a saját bolygóira szállíthat (ez azért fontos, mert szállításnál a célbolygónak is csökken a védelme 24 órára, nem csak a küldő félnek)</li>\r\n</ul>\r\n<p>Az adótáblában az látható, hogy mely tisztségek, milyen erőforrásokból, melyik bolygókra a bruttó termelés hány ezrelékét kötelesek befizetni. Az adófizetés automatikus történik, termelési körönként, <a href="HELP_ROOT?domen=1&id=34">teleportok</a> segítségével, vagyis az adó is fogyasztja a TT-t. Ha egy körben túl kicsi a készlet, vagy nincs elég teleportkapacitás, akkor az adó csak részben teljesül. Ez látható a <a href="HELP_ROOT?domen=0&id=19">taglistában</a> a tag mellett "adómorál" címén: hány körből hányszor teljesített 100%-osan.</p>\r\n<p>A célbolygókra jutó adó bekerül az ottani raktárakba. És ha a raktárak túltelítődnek, akkor a fölösleg megy a szemétbe. Éppen ezért a célbolygókat érdemes folyamatosan felügyelni, hogy a befolyt adót egyből el is használják termelésre vagy építkezésre. Például lehet űrhajógyártásra berendezni egy ilyen bolygót: telerakni gyárakkal, amik a beérkező titánt és egyéb anyagokat egyből fel is használják.</p>', 'screenshot_szov_tisztek.png', 'Saját szövetség adatlapja#Tisztségek', '', 'Profile of your alliance#Ranks'),
(0, 21, '<p>Felül láthatod a szövetség nevét. Alatt a következők:</p>\r\n<ul>\r\n<li><b>...</b>: a szövetség alapítójának megnevezése és személye</li>\r\n<li><b>Alapítva</b>: hány napja jött létre a szövetség</li>\r\n<li><b>Mottó</b>: a szövetség mottója</li>\r\n<li><b>Taglétszám</b>: hány tagja van a szövetségnek</li>\r\n<li><b>Üdvözlet</b>: bárki által látható üdvözlet</li>\r\n</ul>', 'screenshot_szov_idegen.png', 'Idegen szövetség adatlapja', '', 'Profile of someone else''s alliance'),
(0, 26, '<p>Legfelül látható az ügynökök száma. Először az, hogy hány ügynököd van, utána pedig, hogy legfeljebb mennyi lehet. Utóbbi a bolygóidon üzemelő hírszerző központok számától függ: minden központ legfeljebb 100 ügynököt képes eltartani. Körönként egy központ 10 új ügynököt képez ki, vagyis ennyivel nő az ügynökök száma. Ha bevetésen vannak, akkor az ellenséges elhárítás likvidálhatja őket, ennyivel csökken a számuk.</p>\r\n<p>A következő a szabad kapacitás ezrelékben. Amikor megadod, hogy milyen tevékenységet végezzenek az ügynökeid, nem főt adsz meg, hanem ezreléket. Vagyis hogy a teljes hírszerző kapacitásod hány ezrelékét szánod az adott feladatra. A szabad kapacitás jelzi, hogy mennyit tudsz még allokálni. Ennek a rendszernek az az értelme, hogy ha változik az ügynökeid száma, akkor automatikus igazodik az egyes feladatokon dolgozók létszáma.</p>\r\n<p>A likvidált ügynök száma jelzi, hogy a legutolsó bevetésen (óránként van egy) hány ügynöködet likvidálták ellenséges elhárítók.</p>\r\n<p>A tartósan likvidálható ügynökök száma azt jelzi, hogy óránként hány új ügynököd képződik, vagyis legfeljebb hány ügynök likvidálását bírja el hosszútávon a hálózatod. Ha ennél többet likvidálnak, akkor fokozatosan csökkenni fog az ügynökeid száma. Ekkor két dolgot tehetsz: vagy újabb hírszerző központokat építesz, vagy abbahagyod a kémkedést/szabotázst egy-két nagyon jól védett célpont ellen.</p>\r\n<h2>Hírszerzés</h2>\r\n<p>Ha információt akarsz szerezni idegen bolygókról, küld ki kémkedni az ügynökeidet. Add meg a célbolygót és hogy hány ezreléket szánsz rá, majd kattints a Mentés-re. Mellette láthatod, hogy a megadott ezrelék hány ügynököt jelent jelenlegi kapacitásod mellett, illetve hogy közülük hányat likvidáltak utoljára.</p>\r\n<p>Minden bevetésen (óránként van egy) a kémeid egy részét elkapja az ellenséges elhárítás. A maradék pedig véletlenszerűen kiválasztott témákról ír kémjelentéseket (10 ügynökönként 1-et). Ezeket a <a href="HELP_ROOT?domen=0&id=8">bolygó adatlapján</a> láthatod.</p>\r\n<h2>Szabotázs</h2>\r\n<p>Ha szabotálsz egy ellenséges bolygót, akkor a megadott iparágba tartozó gyárai közül időnként néhány megsemmisül. A szabotázs hatékonysága függ a szabotőrök számától, az ellenséges elhárításról, és a célzott gyárak nagyságától (konkrétan az építési idejétől). Minél nagyobb az adott gyár, annál nehezebb felrobbantani.</p>\r\n<p>Ugyanakkor van bevetés, amikor a kémeknek (óránként egyszer). Az elhárítás is hasonlóan működik: 10 elhárító tud elkapni 1 szabotőrt. Az elhárítás után megmaradt szabotőrök próbálnak robbantani. Egy szélfarm felrobbantásához 160x4=640 ügynök kell, mert a szélfarm építési ideje 4 perc. Ha csak 320 ügynök van, akkor 50% valószínűséggel robbantanak. Ha 6400, akkor viszont 10 szélfarmot tudnak felrobbantani. Hasonlóképp egy húsüzemhez 160x20=3200 ügynök kell, mert a húsüzem építési ideje 20 perc. Napi egy húsüzem felrobbantásához elég ennek az 1/24-ed része, vagyis 133, hiszen óránként próbálkoznak a szabotőrök.</p>\r\n<h2>Elhárítás</h2>\r\n<p>Az ellenséges hírszerzés és szabotázs ellen úgy védekezhetsz, ha az ügynökeid egy részét elhárítóként dolgoztatod. 10 elhárító tud likvidálni 1 kémet vagy szabotőrt.</p>', 'screenshot_felderites.png', 'Felderítés menüpont', '', 'Recon menu'),
(0, 27, '<p>Itt láthatod a leveleidet. Jobb fent választhatod ki, hogy a személyes leveleidet akarod olvasni, vagy a rendszerüzeneteket.</p>\r\n<p>Ha írni akarsz valakinek, kattints az új levél-re. A címzetteket vesszővel elválasztva írhatod. Ha a szövetségednek írsz, azt minden tag megkapja (levlista). Idegen szövetségnek csak akkor írhatsz, ha diplomata vagy.</p>\r\n<p>Ha rákattintasz egy levélre a listában, akkor alul megjelenik a teljes levél. Itt válaszolhatsz rá, vagy törölheted. Vigyázz, ha a törlésre kattintasz, egyből törlődik.</p>\r\n<p>Bal oldalt a menüpont a LEVELEK gombon időnként megjelenik egy kék szám. Ez jelzi, hogy hány olvasatlan leveled van.</p>\r\n<p>Frissíteni a LEVELEK gombra kattintva tudsz.</p>', 'screenshot_levelezes_v2.png', 'Levelek menüpont', '', 'Messages menu'),
(0, 22, '<p>Balra fent láthatod az utolsó egy órában keletkezett chat-hozzászólásokat. Ha folyamatosan online vagy, akkor többet is.</p>\r\n<p>Jobbra fent vannak a szövetséged azon tagjai, akik az elmúlt 15 percben aktívak/online voltak. Köztük félkövéren kiemelve azok, akik az elmúlt 5 percben.</p>\r\n<p>Alul tudsz új hozzászólást elküldeni.</p>\r\n<p>Ha volt aktivitás azóta, hogy utoljára megnézted a chat-et, akkor balra a SZÖVETSÉG menünél megjelenik egy kis piros C betű.</p>', '', 'Saját szövetség adatlapja#Chat', '', 'Profile of your alliance#Chat'),
(0, 104, '<h2>Kezdővédelem</h2>\r\n<ul>\r\n<li>aki inaktív (7 napnál régebb óta) vagy több bolygója van, az nem kap semmilyen védelmet</li>\r\n<li>aki aktív, egy bolygója van, és van fellőtt flottája, szabotál, kémkedik, szállít, vagy szállítanak neki, azt fosztogatni lehet, de elfoglalni vagy szabotálni nem</li>\r\n<li>aki aktív, egy bolygója van, és nincs fellőtt flottája, nem szabotál, nem kémkedik, nem szállít, nem szállítanak neki, az teljes védelmet élvez</li>\r\n</ul>\r\n<p>Az utolsó flotta leadása, az utolsó szabotálás, kémkedés vagy szállítás után még 24 óráig fel van függesztve a teljes védelem. Vagyis ekkor még lehet fosztogatni. Ez azért van, hogy ne lehessen (annyira) visszaélni az egybolygós védelemmel.</p>\r\n<p>A fenti védelmi szintek között folyamatos átjárás van. Vagyis ha egy bolygód van, és elfoglalsz egy másikat, akkor megszűnik a védelmed. Ha utána elveszted valamelyiket, akkor újra védett leszel (a megmaradt bolygódon) (de 24 óráig még fosztogatható vagy).</p>\r\n<h2>Inaktivitás</h2>\r\n<p>Ha 7 napig inaktív vagy, akkor a védelmed teljesen megszűnik, és elfoglalhatóvá válik a bolygód. Ha utána bejelentkezel, akkor újra megkapod a megfelelő védelmet.</p>\r\n<p>Ha 30 napig inaktív vagy, akkor törlődik a regisztrációd. Véglegesen.</p>', '', 'Kezdővédelem és inaktivitás', '', ''),
(0, 105, '<p>Szövetségen belül lehetőség van adóztatásra. Akinek ilyen jogosultsága van, a szövetség <a href="HELP_ROOT?domen=0&id=20">Tisztségek</a> menüpontjában tudja beállítani az adótáblát.</p>\r\n<p>Az adótáblában az látható, hogy mely tisztségek, milyen erőforrásokból, melyik bolygókra a bruttó termelés hány ezrelékét kötelesek befizetni. Azért a bruttó termelés az adó alapja, mert ez mutatja valójában a gazdaság méretét. A nettó termelést a legtöbb esetben ki lehet nullázni, ha megfelelően hasznosítjuk a terméket. Élelmiszerből például, ha csak nem akarunk valamiért készleteket felhalmozni, csak annyit érdemes termelni, amennyit a lakosság elfogyaszt. Így a nettó termelés nulla lesz, akár 50 ezer, akár 5 millió fő a népességünk, miközben az utóbbi esetben nyilván többet tudnánk áldozni közös célokra, vagyis "illene" több adót fizetnünk. Azzal, hogy az adóalap a bruttó termelés, ez valósul meg.</p>\r\n<p>Az adófizetés automatikusan történik, termelési körönként, <a href="HELP_ROOT?domen=1&id=34">teleportok</a> segítségével, vagyis az adó is fogyasztja a TT-t. Ha egy körben túl kicsi a készlet, vagy nincs elég teleportkapacitás, akkor az adó csak részben teljesül. Ez látható a taglistában a tag mellett "adómorál" címén: hány körből hányszor teljesített 100%-osan. Fontos tehát, hogy csak olyan mértékben vessünk ki adókat, hogy az adózottak azokat be tudják fizetni, és lehetőleg még maradjon is teleport kapacitásuk, amivel szállítani és kereskedni tudnak.</p>\r\n<p>A célbolygókra jutó adó bekerül az ottani <a href="HELP_ROOT?domen=0&id=106">raktárakba</a>. És ha a raktárak túltelítődnek, akkor a fölösleg megy a szemétbe. Éppen ezért a célbolygókat érdemes folyamatosan felügyelni, hogy a befolyt adót egyből el is használják termelésre vagy építkezésre. Például lehet űrhajógyártásra berendezni egy ilyen bolygót: telerakni gyárakkal, amik a beérkező titánt és egyéb anyagokat egyből fel is használják. A sorrend ugyanis: 1. adó, 2. termelés, 3. raktározás, vagyis lehetőség van a raktárakat adóval túltelíteni, ha egyből felhasználjuk a felesleget.</p>\r\n<p>Az adózás a szállítással egyenértékű a kezdővédelem szempontjából: vagyis aki adózik és akinek adóznak, az 24 órára részlegesen elveszti a védelmét (már ha volt neki egyáltalán).</p>', '', 'Hogy működik az adózás?', '', '');
INSERT INTO `leirasok` (`domen`, `id`, `leiras`, `kep`, `cim`, `leiras_en`, `cim_en`) VALUES
(0, 106, '<p>Minden <i>termelt</i> erőforrásból (vagyis a 4 természeti kincs: nyers kő, nyers homok, titánérc, uránérc nem tartozik ide) csak annyink lehet, amennyi a raktárakban elfér. Nincsenek külön raktárépületek, hanem minden gyár a saját termékét raktározza. Méghozzá a teljes bruttó termelés 500-szorosát. Ez azt jelenti, hogy nem csak az üzemben lévő, és nem is csak az aktív, hanem az inaktív gyárak is növelik a raktárkapacitást. Minden körben, a termelés után elvész a raktárkapacitás feletti rész. Vagyis ha egy gyár termékét semmire nem használjuk, akkor 500 kör alatt megtelik a raktára, ami valamivel több, mint 5 napot jelent (1 nap 96 kör). Ha a gyár köztes terméket állít elő, ami felhasználunk (pl olajat a műanyaggyártáshoz), akkor sokkal lassabban telik be a raktár, vagy akár soha, ha a teljes termelés hasznosítjuk.</p>\r\n<p>Mivel a készlet tartósan nem mehet a raktárkapacitás, vagyis a bruttó termelés 500-szorosa fölé, ezért pl egy <a href="HELP_ROOT?domen=1&id=23">üveggyár</a>ral csak 500x30 = 15ezer üveglapnyi készletet lehet felhalmozni. Mivel egy <a href="HELP_ROOT?domen=1&id=30">város</a> építéséhez 30ezer üveglapra van szükség, ezért minimum két üveggyárat kell előbb felhúzni (vagy a tőzsdéről gyorsan bevásárolni, lásd lentebb).</p>\r\n<p>A raktár telítettségét a bolygó <a href="HELP_ROOT?domen=0&id=4">Gazdaság menü</a>jében a készlet színe mutatja: 90% fölött narancs, ha pedig 100%-ra nő, vagyis betelik a raktár, akkor piros. Ilyen esetben érdemes a fölösleget eladni a tőzsdén, vagy építeni belőle valamit, mert a további termelés már a szemétbe kerül.</p>\r\n<p>Ha vásárlunk a <a href="HELP_ROOT?domen=0&id=6">tőzsdéről</a>, vagy szállít nekünk egy szövitársunk, vagy mi magunk egy másik bolygónkról küldünk erőforrást, akkor ideiglenesen átléphetjük a raktárkapacitást, egészen a következő körig. Vagyis lehetőség van például gyorsított tempóban kolonizálni egy frissen elfoglalt bolygót. Megnézzük, mikor van a célbolygón termelés legközelebb, és ha csak sokára (mondjuk csak 10 perc múlva), akkor gyorsan átteleportálunk egy csomó építőanyagot, amiből egyből építünk is gyárakat, településeket. Így, mire jön a következő termelési kör, már újra elférünk a raktárakban, hiszen a fölösleget építkezésre használtuk.</p>\r\n<p>Egy másik speciális eset az <a href="HELP_ROOT?domen=0&id=105">adózás</a>. Mivel a sorrend: 1. adó beérkezése, 2. termelés, 3. raktározás, ezért lehetőség van arra, hogy egy szövetség kijelöljön egy bolygót például űrhajógyártásra, ahol a termelés adóból történik. Vagyis tetszőleges mennyiségű titánt és egyebet lehet oda utalni adóként, amennyiben azt egyből fel is használjuk termelésre.</p>', '', 'A raktározásról', '', ''),
(0, 107, '<p>Egy bolygó/flotta vagy magánkézben van, vagy közös (szövetségi) tulajdonban. Utóbbi esetben a szövetség (konkrétan a megfelelő jogosultságú emberek) rendelkeznek a bolygó/flotta felett, ők döntik el, kinek adják át a bolygót/flottát kezelésre, esetleg kinek adják oda magántulajdonba. És mindig van <b>egy</b> valaki (a "kezelő"), aki irányítja az adott bolygót/flottát.</p>\r\n<p>Ha van egy bolygód/flottád, amit szeretnél beadni a közösbe, akkor az adatlapján a neve mellett kattints a csoport ikonra. Bolygónál ez csak akkor jelenik meg, ha egynél több magánbolygód van, mert (a visszaélések elkerülése végett) nincs megengedve, hogy valakinek egyáltalán ne legyen saját bolygója. Ha egyszer közösbe adtad a bolygót/flottát, akkor onnantól már a szövetség rendelkezik felette, bár még te vagy a kezelő.</p>\r\n<p>A szövetség <a href="HELP_ROOT?domen=0&id=18">Közös menü</a>jében látható a közös bolygók és flották. Akinek van hozzá jogosultsága, az megváltoztathatja, hogy ki kezelje őket. Bolygó esetén a leendő kezelőnek el kell fogadnia a megbízást, hiszen ha eddig csak egy bolygója volt, akkor ezzel a lépéssel <a href="HELP_ROOT?domen=0&id=104">elveszti a teljes védelmét</a>. Flotta esetén nem kell elfogadni, az automatice a kijelölt kezelőhöz kerül. Szintén itt lehet a közös tulajdont magánkézbe adni. Ekkor a bolygó/flotta a kezelője tulajdonába kerül, vagyis innentől már ő rendelkezik fölötte, a szövetségnek nincs beleszólása.</p>\r\n<p>A <a href="HELP_ROOT?domen=0&id=104">kezdővédelem</a>nél és a bolygó/flottalimitnél a saját tulajdonban és a kezelésben lévő bolygók/flották együttesen számítanak. Vagyis ha van egy magán- és egy közös bolygód, akkor nem kapsz védelmet. Ha csak közös flottád van, az harci tevékenységnek minősül (vagyis legfeljebb foglalás elleni védelmet kapsz). Ha 2 a bolygólimited, akkor a magánbolygódon kívül már csak egy saját vagy közös bolygód lehet.</p>\r\n<p>Ha közös bolygóról küldenek fel hajókat egy új flottába, az szintén közös lesz. Ha egy közös flottából válik ki egy alakulat, az is. Ha pedig közös flottával foglal valaki bolygót, akkor a bolygó is közös tulajdonba kerül.</p>\r\n<p>Ha a bolygó/flotta kezelője kilép a szövetségből, vagy kirúgják, akkor a kezelésében lévő közös bolygók/flották az alapítóhoz kerülnek. Ő aztán átadhatja másnak.</p>', '', 'Közös bolygók és flották', '', ''),
(0, 28, '<p>Legfelül láthatod az alap adataidat:</p>\r\n<ul>\r\n<li>Neved</li>\r\n<li>Azonosítód: ez hibajelentésnél lehet hasznos</li>\r\n<li>Ajánló link: ha ezt elküldöd valakinek, vagy kiteszed a blogodra, honlapodra, és ezen keresztül valaki regisztrál és előfizet valamilyen prémium szolgáltatásra, akkor abból te is részesülsz</li>\r\n<li>E-mail címed</li>\r\n<li>Regisztráltál</li>\r\n<li>Sztázisban: ez csak ideiglenesen látszódik, amíg el nem készül a rendes sztázis (vakáció mód)</li>\r\n<li>Aki meghívott: itt látszik, hogy kin keresztül regisztráltál a játékban. Ha utólag szeretnéd bejelenteni, mert amikor regisztráltál, még nem volt ilyen lehetőség, akkor szólj. Így ha te előfizetsz valamilyen prémium szolgáltatásra, az is kap belőle, aki meghívott.</li>\r\n</ul>\r\n<p>PRÉMIUM szolgáltatás: ezután jön az avatárod, ami egy legfeljebb 32x32-es ikon (nagyobbat is feltölthetsz, de ekkor át lesz méretezve). Az avatár az adatlapodon látható, illetve másutt is, ahol megjeleneik a neved (pl toplista, szövetségi taglista, de ez a kör még bővül).</p>\r\n<p>PRÉMIUM szolgáltatás: Jegyzeteket vehetsz fel magadnak, ahol számon tarthatod, hogy ki tartozik neked, milyen fejlesztési vagy háborús terveid vannak, vagy bármit, ami a játékkal kapcsolatos (vagy akár ami nem). Ezeket a jegyzeteket csak te látod, se a szövitársaid, se más nem. Az "új jegyzet"-re kattintva tudsz új jegyzetet írni, amit a lemez ikonnal tudsz elmenteni. A meglévő jegyzetek sorrendjét a fel/le nyilakkal tudod módosítani. A kulcs ikonnal lehet szerkeszteni, az X-szel pedig törölni.</p>\r\n<p>Játékos kereső: írd be egy játékos nevét, nyomj entert, és az adatlapján találod magad</p>\r\n<p>Jelszó módosítása: írd be a régi jelszavad, utána az újat kétszer, majd nyomj entert, így módosíthatod a jelszavad. Az első bejelentkezés után érdemes megtenni, hogy olyan jelszavad legyen, amit fejből is tudsz, és nincs benne az email-jeidben</p>\r\n<p>Regisztráció törlése: ha valamiért törölni szeretnéd az accountodat, például rossz helyre regisztráltál, és szeretnéd tiszta lappal kezdeni másutt, akkor ezt itt teheted meg. Ezt a lépést nem lehet visszavonni. Ha törlöd magad, akkor eltűnsz a játékból, a flottáid törlődnek, a bolygóid resetelődnek.</p>', '', 'Profil menüpont', '', 'Profile menu'),
(0, 29, '<p>Legfelül láthatod a játékos avatárját (ha előfizetett a PRÉMIUM-ra), nevét, és az alap adataidat:</p>\r\n<ul>\r\n<li>Regisztrált</li>\r\n<li>Sztázisban: ez csak ideiglenesen látszódik, amíg el nem készül a rendes sztázis (vakáció mód)</li>\r\n<li>Szövetség: melyik szövetség tagja ("magányos farkas", ha egyiknek sem)</li>\r\n<li>Tisztség: ha tagja szövetségnek, milyen tisztsége van</li>\r\n<li>Pontszám</li>\r\n<li>Helyezés</li>\r\n<li>Kezdővédelem: részletesen lásd <a href="HELP_ROOT?domen=0&id=104">ITT</a></li>\r\n<li>Aki meghívta: itt látszik, hogy kin keresztül regisztrált a játékban. Ha a játékos előfizet valamilyen prémium szolgáltatásra, az is kap belőle, aki meghívta.</li>\r\n</ul>\r\n<p>PRÉMIUM szolgáltatás: Az adatlapodat bővítheted, ha szeretnél több információt megosztani magadról (pl milyen típusú játékos vagy, melyik a kedvenc sci-fi sorozatod). Ezek az "Egyéb" alatt jelennek meg. Soronként egy tulajdonságot adhatsz meg, pl Mi legyen a tulajdonság? "Játékstílus", Mi legyen a tartalom? "Békés kereskedő". A már felvett tulajdonságokat a fel/le nyilakkal rendezheted, a kulcs ikonnal szerkesztheted, az X-szel törölheted. Ezeket mindenki látni fogja, aki megnézi az adatlapod.</p>\r\n<p>Bolygói: a játékos bolygóinak felsorolása. Mindegyiknél jelezve van, ha szövetségi tulajdonról van szó, amit ez a játékos kezel. És az is, hogy hány kémed van az adott bolygón.</p>', '', 'Játékos adatlapja', '', 'Profile of a player'),
(2, 219, '<p>A Behemót nevét a támadás előtt összehívott első EBSZ konferencián kapták fel. Nem csoda, hogy a név rajta ragadt ezen a hatalmas méretű hajón, hiszen egymagában játszva elbír két-három nemezissel is. A főerőkben tömegben érkező Behemótok ellen csak egy szövetségeken átívelő összefogásnak lehet keresnivalója.</p>\r\n<p>A hatalmas méret a könnyűcirkálók lomhaságával jár együtt, ezért az EBSZ által kidolgozott terv szerint az összevont véderő kihasználja relatív gyorsaságát, és az emberiség így kerekedhet az idegen erők fölé.</p>', 'behemot', 'Behemót', '', 'Behemoth'),
(2, 220, '<p>Nehéz egyértelműen állást foglalni a Zeusz erejéről, bár nem tekinthető az idegen technológia csúcsteljesítményének, minden bizonnyal ez a hajóhad fogja a legszámottevőbb pusztítást véghez vinni. A Zeusz legkellemetlenebb tulajdonsága, hogy sebességét csak a Fulgur tudja felülmúlni, így várhatóan védtelen bolygók százai fognak áldozatul esni. Bár az ötödik-hatodik generációs emberi hajók erejével rendelkezik, a megfigyelések szerint tömegben könnyen sebezhetővé válik.</p>', 'zeusz', 'Zeusz', '', 'Zeus'),
(2, 221, '<p>Amikor 1945-ben Eisenhower eldicsekedett Zsukovnak, hogy milyen modern aknaszedő gépeik vannak, Zsukov csak ennyit felelt: az aknamezők felszámolásának legjobb módja, ha áthajtjuk rajta a gyalogságot. Valami hasonló perverz logika eredménye lehet a Szúnyog. Törékeny felépítéséből, kis méretéből és az eddig észlelt nagy mennyiségből a tudósok arra következtetnek, hogy a könnyűcirkálóknál is gyengébb hajótípusról van szó, amit ugyan egy mozdulattal le lehet csapni, viszont milliószámra fogják bevetni.</p>', 'szunyog', 'Szúnyog', '', 'Mosquito'),
(2, 222, '<p>Bár a működési elvét még nem sikerült megfejteni, úgy tűnik az Akna a bolygóannihilátorokhoz hasonlóan apró feketelyukakat generál. A megfelelően méretezett és célzott fekete lyuk előbb magába szippantja a célpontot, majd a Hawking-sugárzás következtében felrobban, megsemmisítve annak környezetét is. Ezzel akár több száz nemesist is eltakarít egy csapásra. Ha célba talál. Ugyanis a fekete lyuk eltorzítja a téridőt, és ez mind az időzítést, mind a célzást jelentősen megnehezíti. Éppen erről a bizonytalanságról, és irtózatos pusztító erejéről kapta a típus a nevét.</p>', 'akna', 'Akna', '', 'Mine'),
(2, 223, '', 'castor', 'Castor', '', 'Castor'),
