INSERT INTO `levelek` (`id`, `felado`, `tulaj`, `ido`, `targy`, `uzenet`, `olvasott`, `mappa`, `cimzettek`) VALUES
(1, 2, 1, '2012-12-24 13:25:42', 'Üdv a játékban!', 'Kedves kisPocok!\n\nÜdvözlünk a Zandagortban!\r\n\r\nAhogy fejlődsz a játékban, úgy fogsz ilyen leveleket kapni, amik segítenek megismerkedni a játék egyes részeivel és próbálnak rávezetni a "Zandás gondolkodásra" A levelek 3 részből állnak:\r\n<ul class="classic_lista">\r\n<li>Tartalom: itt találhatod pontokba szedve a témákat és a teljesítendő feladatokat</li>\r\n<li>Leírás: témák kifejtése és a feladatok megoldásának részletes leírása</li>\r\n<li>Tippek és tanácsok: pár hasznos apróság</li>\r\n</ul>\r\n\r\n<b style="color:red">Érdemes egy külön fülön megnyitnod a <a href="http://zandagort.hu/wiki/Tutorial_S8" target="_blank">TUTORIAL</a>t, mert ott jóval részletesebb leírást és segítséget találsz.</b>\r\n\r\n<h2>1. A játékról általában</h2>\r\n<h2>2. Feladat - Kezdjünk építkezni</h2>\r\n<ul class="classic_lista">\r\n<li>Építs 1 db fűrészmalmot\r\n<li>Építs 1 db kőbányát\r\n</ul>\r\n\r\n<hr />\r\n\r\n<h2>1. Pár szó a játék felületéről</h2>\r\n\r\nA játék felülete alapvetőn 4 részre osztható:\r\n- Bolygók (balra fent)\r\n- Flották (bolygók alatt)\r\n- Menü (flották alatt)\r\n- Fő képernyő (minden ezektől jobbra)\r\n\r\nEleinte a következőket fogod használni:\r\n- Bolygó adatlap\r\n- Levelek\r\n- És persze a chat :)\r\n\r\n<h2>2. Első építkezés</h2>\r\n\r\nMivel Zandagort egy gazdaságra épülő stratégiai játék, kezdjük egy kis építkezéssel. Először is lépj a bolygód adatlapjára: kattints a bolygód nevére a bal felső sarokban lévő listán. A bolygó adatlapján több fület is láthatsz (Ökoszféra, Gazdaság, Háború stb.), egyelőre csak a "Gazdaság"-ra lesz szükséged.\r\n\r\nAmint láthatod, a bolygón van egy minimális alap ipar (bal oldali oszlop) és egy induló nyersanyag készlet (jobb oldali oszlop). Új épületet két módon tudsz építeni:\r\n<ul class="classic_lista">\r\n<li>Meglévő épület nevére kattintva legördülő menüből.</li>\r\n<li>Ha még nincs olyan épületed, az lista alján lévő "Új épület"opcióra kattintva a megfelelő kategóriából.</li>\r\n</ul>\r\n\r\nÉpítéshez írd az építeni kívánt mennyiséget a megfelelő sorba, majd kattints az "épít" vagy "inaktívat épít" gombra. Ebben az esetben válaszd a sima "épít" lehetőséget. Inaktív esetén az épület megépül, de nem fog se termelni, se fogyasztani, amíg nem aktiválod. Építsd meg a következőket:\r\n<ul class="classic_lista">\r\n<li>1 db fűrészmalom</li>\r\n<li>1 db kőbánya</li>\r\n</ul>\r\n\n\n\nZandagort és népe\n\nu.i. Ez egy automatikusan generált üzenet, ne válaszolj rá, mert nem lesz, aki elolvassa. Írj a <a href="http://forum.example.com/" target="_blank">fórum</a>ra, vagy ha privát ügy, akkor az <a href="mailto:info@example.com">info@example.com</a> címre.', 1, 'Bejövő', ',1,'),
(2, 2, 1, '2012-12-24 13:25:42', 'Aktiváld a regisztrációdat!', 'Kedves kisPocok!\n\nAhhoz, hogy véglegesen használni tudd a regisztrációdat, aktiválnod kell, különben egy hét múlva ki leszel tiltva. Ha jól adtad meg az email címed (mousehu@gmail.com), akkor kaptál egy levelet, benne egy aktiváló linkkel. Ha nem érkezett meg, nézd meg, hátha szpemnek nézte a levelezőrendszered. Ezt azért is fontos ellenőrizned, mert ha bármi változás történik a játékban, arról is emailben lesz értesítés. Ha egy(-két) napon belül nem kapod meg az aktiváló levelet, írj egy emailt az <a href="mailto:info@spaceless.deb?subject=aktivacio">info@spaceless.deb</a> címre ''AKTIVÁCIÓ'' tárggyal. Jó szórakozást a játékhoz!\n\n\nZandagort és népe\n\nu.i. Ez egy automatikusan generált üzenet, ne válaszolj rá, mert nem lesz, aki elolvassa. Írj a <a href="http://forum.example.com/" target="_blank">fórum</a>ra, vagy ha privát ügy, akkor az <a href="mailto:info@example.com">info@example.com</a> címre.', 1, 'Bejövő', ',1,'),
(3, 2, 1, '2012-12-24 13:27:06', 'Kezdőkészlet felhasználása', 'Kedves kisPocok!\n\nGratulálok! Most már látod, hogy lehet építkezni. Akkor vágjunk is bele a komolyabb beruházásokba:\r\n\r\n<h2>1. Gazdasági alapok</h2>\r\n<h2>2. Feladat - Kezdőkészlet felhasználása</h2>\r\n<ul class="classic_lista">\r\n<li>Építs 80 db falut</li>\r\n<li>Építs 6 db inaktív fűrészmalmot</li>\r\n<li>Építs 4 db inaktív kőbányát</li>\r\n<li>Építs 2 db húsüzemet</li>\r\n<li>Építs 70 db szélfarmot</li>\r\n</ul>\r\n\r\n<hr />\r\n\r\n<h2>1. Gazdasági alapok</h2>\r\n\r\nMivel a Zandagort egy stratégiai játék, fontos szerepe van a gazdaságnak. A jó gazdaság kiépítésénél kulcsfontosságú a rendelkezésre álló nyersanyagok felhasználása, visszaforgatása a gazdaság fejlesztésébe. Az alap nyersanyagok termelése a legfontosabb, ez pedig a fa és a kő. Nem csak a játék elején kell rájuk figyelni, később is meghatározza a növekedés ütemét. A kettő közül a kő az igazi kulcs, ezért a kőtermelés növelésére kell felkészíteni az ipart a kezdő készletből, amihez sok fára van szükség.\r\n\r\n<h2>2. Kezdőkészlet felhasználása</h2>\r\n\r\nMivel a raktáron álló nyersanyag "nem dolgozik", fektessük építkezésekbe a rendelkezésre álló készletet. Először lakosságra lesz szükség, majd mellé fel lehet húzni a termelő épületeket. Mivel nincs elég munkaerő és a lakosság növelése kis időbe telik (a munkaerő mindig az aktuális lakosság fele), a termelő egységeket inaktívnak építsd meg, majd ahogy növekszik a lakosság, úgy aktiváld őket. Építsd fel a következőket:\r\n<ul class="classic_lista">\r\n<li>80 db falu</li>\r\n<li>70 db szélfarm</li>\r\n<li>2 db inaktív húsüzem</li>\r\n<li>6 db inaktív fűrészmalom</li>\r\n<li>4 db inaktív kőbánya</li>\r\n</ul>\r\n\r\nLehet még taktikázni a tech-szinttel is: ha megépül a 80 falu, a lakosság növekedésével pár körön belül el fogod érni az 1-es tech-szintet, ahol gazdaságosabb erőmű válik elérhetővé. Ebben az esetben nem kell szélfarmot építeni, hanem az 1-es tech-szint elérése után bioetanol vagy geotermikus erőművet építesz (a bolygó osztályától függ, hogy melyiket tudod építeni). Ha beraktad őket épülni, akkor amíg épülnek, kicsit rátérhetünk a hadászatra :)\r\n\r\n<h2>Tippek és tanácsok:</h2>\r\n<ul class="classic_lista">\r\n<li>Az építési költségeket és az épületek energia illetve munkaerő szükségletét a legördülő építési menüben láthatod</li>\r\n<li>Az épületek ikonjára kattintva elérheted a részletes leírásukat</li>\r\n<li>Nem érdemes halmozni a nyersanyag készleteket, ajánlott mindent elhasználni ami raktáron van</li>\r\n</ul>\r\n\n\n\nZandagort és népe\n\nu.i. Ez egy automatikusan generált üzenet, ne válaszolj rá, mert nem lesz, aki elolvassa. Írj a <a href="http://forum.example.com/" target="_blank">fórum</a>ra, vagy ha privát ügy, akkor az <a href="mailto:info@example.com">info@example.com</a> címre.', 1, 'Bejövő', ',1,');
